--
-- TOC entry 418 (class 1255 OID 506896)
-- Name: sp_analyze_sale(); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION sp_analyze_sale() RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
	nId товар.КОД%TYPE;
	nZapas проводки.КОЛ%TYPE;
	dDate1 DATE;
	dDate2 DATE;
	curTovar REFCURSOR;
BEGIN
	dDate1 = current_date - (SELECT ЗНАЧЕНИЕ::integer FROM константы WHERE trim(ИМЯ) = 'МаксДнейВПродаже');	-- будем считать продажи товара за последний год
	dDate2 = current_date;

	DROP TABLE IF EXISTS __Temp__;
	DROP TABLE IF EXISTS __Temp1__;
	
	CREATE TEMP TABLE __Temp__ (
			ДАТА DATE, 
			ДБКОЛ NUMERIC(10, 3),
			КРКОЛ NUMERIC(10, 3), 
			ОСТАТОК NUMERIC(10, 3)
			);
	CREATE TEMP TABLE __Temp1__ (
			НАЧАЛО DATE,
			КОНЕЦ DATE,
			ПРОДАНО	NUMERIC(10, 3), 
			ТЕМП_ПРОДАЖ NUMERIC(10, 3)
			);

	OPEN curTovar FOR
		SELECT t.КОД
		FROM товар t
		WHERE t.ЗАПАС > 0;

	LOOP
		FETCH curTovar INTO nId;
		EXIT WHEN NOT FOUND;			-- Если больше нет позиций, то выход
		nZapas = (SELECT sp_analyze_sale_pos(nId, dDate1, dDate2));
		UPDATE товар SET АВТЗАПАС = nZapas WHERE КОД = nId;
		DELETE FROM __Temp__;
		DELETE FROM __Temp1__;
	END LOOP;
	CLOSE curTovar;
--	DROP TABLE __Temp__;
--	DROP TABLE __Temp1__;
END;
$$;


