--
-- TOC entry 417 (class 1255 OID 506898)
-- Name: sp_analyze_sale_pos(integer, date, date); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION sp_analyze_sale_pos(integer, date, date) RETURNS numeric
    LANGUAGE plpgsql
    AS $_$
DECLARE
	nId товар.КОД%TYPE;
	nPost проводки.КОЛ%TYPE;
	nProd проводки.КОЛ%TYPE;
	nOst сальдо.КОНКОЛ%TYPE;
	nOst1 сальдо.КОНКОЛ%TYPE;
	nOst2 сальдо.КОНКОЛ%TYPE;
	nZapas товар.АВТЗАПАС%TYPE;
	nAvg товар.АВТЗАПАС%TYPE;
	dDate DATE;
	dDate1 DATE;
	dDate2 DATE;
	curTovar REFCURSOR;
	curProd REFCURSOR;
BEGIN
	nId = $1;
	dDate1 = $2;
	dDate2 = $3;
	INSERT INTO __Temp__ SELECT ДАТА, SUM(ДБКОЛ) AS ДБКОЛ, SUM(КРКОЛ) AS КРКОЛ, 0 AS ОСТАТОК
		FROM sp_calctovaroborot(nId, to_char(dDate1, 'DD.MM.YYYY'), to_char(dDate2, 'DD.MM.YYYY'))
		GROUP BY ДАТА 
		ORDER BY ДАТА ASC, ДБКОЛ DESC;

	-- Посчитаем остаток товар на конец дня, когда была продажа
	OPEN curProd FOR SELECT ДАТА, ДБКОЛ, КРКОЛ FROM __Temp__;
	nOst = 0;
	dDate1 = current_date;
	LOOP
		FETCH curProd INTO dDate, nPost, nProd;
		IF FOUND THEN			-- Если больше нет позиций, то выход
			nOst = nOst + nPost - nProd;
			UPDATE __Temp__ SET ОСТАТОК = nOst WHERE ДАТА = dDate;
			dDate1 = dDate;
		ELSE
			IF dDate1 < current_date - 7 AND nOst > 0 THEN	-- Если товар лежит уже больше недели
				INSERT INTO __Temp__ (ДАТА, ДБКОЛ, КРКОЛ, ОСТАТОК) VALUES (current_date, 0, 0, nOst);
			END IF;
			EXIT;
		END IF;
	END LOOP;
	CLOSE curProd;

	-- Найдем пары "привезли - минимальный остаток", т.е. периоды между привозами и днем, когда был минимальный остаток или товар закончился
	OPEN curProd FOR SELECT ДАТА, ДБКОЛ, КРКОЛ, ОСТАТОК FROM __Temp__ ORDER BY ДАТА DESC;
	FETCH curProd INTO dDate, nPost, nProd, nOst;
	dDate2 = dDate;
	nOst2 = nOst;
	LOOP
		FETCH curProd INTO dDate, nPost, nProd, nOst;
		EXIT WHEN NOT FOUND;			-- Если больше нет позиций, то выход
		IF nPost > 0 THEN
			LOOP				-- Цикл на случай, если было несколько привозов подряд, а между ними продаж не было
				nOst1 = nOst;
				dDate1 = dDate;
				FETCH curProd INTO dDate, nPost, nProd, nOst;
				IF NOT FOUND OR nPost = 0 THEN
					IF (dDate1 <> dDate2) AND (nOst1 > nOst2) THEN
						INSERT INTO __Temp1__ (НАЧАЛО, КОНЕЦ, ПРОДАНО, ТЕМП_ПРОДАЖ) VALUES (dDate1, dDate2, nOst1 - nOst2, (nOst1 - nOst2)/(dDate2 - dDate1));
					END IF;
					nOst1 = nOst;
					nOst2 = nOst;
					IF nOst > 0 THEN				-- Товар перед этим не был полностью распродан
						dDate2 = dDate1 - 1;
					ELSE
						dDate2 = dDate;
					END IF;
					dDate1 = dDate;
					EXIT;
				END IF;
			END LOOP;
		END IF;
	END LOOP;
	nAvg = (SELECT AVG(ТЕМП_ПРОДАЖ) FROM __Temp1__);	-- Посчитаем средний темп продаж
	IF (SELECT COUNT(*) FROM __Temp1__) < 3 THEN
		nZapas = (SELECT ЗАПАС FROM товар WHERE КОД = nId);
	ELSE
		nZapas = (SELECT AVG(ТЕМП_ПРОДАЖ)*14 
			FROM (SELECT * 
				FROM __Temp1__
				ORDER BY НАЧАЛО DESC 
				LIMIT 3) s);	-- Посчитаем средний запас на 2 недели по 3-м последним привозам, исключая значения, которые отличаются в 10 раз
	END IF;
	IF nZapas < 1 THEN		-- Если прогнозируемые продажи в месяц < 1
		IF nZapas*12*2 >= 1 THEN-- а в год >= 1
			nZapas = 1;	-- То будем держать в продаже 1 единицу запаса
		ELSE
			nZapas = 0;	-- Если прогнозируемые продажи в год меньше 1 шт, то запас держать не будем
		END IF;
	ELSE
--		IF nZapas >= 3 THEN		-- Если запас на 2 недели > 3 шт
--			nZapas = nZapas * 1.3;	-- То создадим еще страховой запас 30%
--		END IF;
		nZapas = round(nZapas);
	END IF;
	RETURN nZapas;
END;
$_$;


