--

CREATE FUNCTION sp_calcnewprice(ngroup integer, nprice numeric) RETURNS real
    LANGUAGE plpgsql
    AS $$
DECLARE 
	nResult REAL;
BEGIN
	nResult := (SELECT CASE
			WHEN d."ОКРУГЛЕНИЕ" = 1::numeric THEN round(d."НОВЦЕНА" * 2::numeric, 0) / 2::numeric
			WHEN d."ОКРУГЛЕНИЕ" = 2::numeric THEN round(d."НОВЦЕНА", 0)
			WHEN d."ОКРУГЛЕНИЕ" = 3::numeric THEN round(d."НОВЦЕНА", (-1))
			WHEN d."ОКРУГЛЕНИЕ" = 4::numeric THEN round(d."НОВЦЕНА", (-2))
			ELSE d."НОВЦЕНА"
			END AS "НОВЦЕНА"
		FROM (SELECT nprice * (100 + НАЦЕНКА) / 100 AS НОВЦЕНА, ОКРУГЛЕНИЕ 
			FROM наценки 
			WHERE КОД_ГРУППЫ = ngroup AND nprice >= МИНПОРОГСУММА AND nprice < МАКСПОРОГСУММА
		LIMIT 1) d);
	RETURN nResult;
END;
$$;


