-- Name: sp_del_bad_positions(); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION sp_del_bad_positions() RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
	nId товар.КОД%TYPE;
	cName товар.ИМЯ%TYPE;
	nZapas товар.ЗАПАС%TYPE;
	dDate1 DATE;
	dDate2 DATE;
	curTemp REFCURSOR;
BEGIN
	dDate1 = current_date - (SELECT ЗНАЧЕНИЕ::integer FROM константы WHERE trim(ИМЯ) = 'МаксДнейВПродаже');	-- будем считать продажи товара за последний год
	dDate2 = current_date;

	OPEN curTemp FOR
		SELECT t.КОД, t.ИМЯ, t.ЗАПАС
		FROM товар t INNER JOIN (SELECT n.КОД_ТОВАР AS КОД
					FROM сальдо s INNER JOIN набор1 n ON s.КОД = n.КОД 
					WHERE s.СЧЕТ = '411' AND s.КОНКОЛ <> 0) s ON t.КОД = s.КОД
		WHERE t.ЗАПАС > 0;
	LOOP
		FETCH curTemp INTO nId, cName, nZapas;
		IF NOT FOUND THEN			-- Если больше нет позиций, которые нужно убрать
			EXIT;				-- то выход
		END IF;
		IF (SELECT COUNT(*) FROM sp_calctovaroborot(nId, to_char(dDate1, 'DD.MM.YYYY'), to_char(dDate2, 'DD.MM.YYYY')) WHERE ДАТА <> dDate1) = 0 THEN
			INSERT INTO журнал (ИМЯ, ДАТА, ДАТАВРЕМЯ, СОДЕРЖАНИЕ, КОД_ТОВАР) VALUES ('sp_del_bad_positions', current_date, current_timestamp, 'Не будет заказываться позиция: ' || trim(cName) || '. Старое значение нормы запаса = ' || trim(to_char(nZapas, '999')) || '.', nId);
			UPDATE товар SET ЗАПАС = 0 WHERE КОД = nId;
		END IF;
	END LOOP;
	CLOSE curTemp;
END;
$$;


