--

CREATE FUNCTION sp_get_users() RETURNS SETOF sp_get_users_fret
    LANGUAGE plpgsql
    AS $$
DECLARE ret_row sp_get_users_fret%ROWTYPE;
	users_cursor REFCURSOR;
	id	INTEGER;
	name	users.ИМЯ%TYPE;
	
	
BEGIN
	id := (SELECT MAX(КОД) + 1 FROM users);
	IF id IS NULL THEN
		id := 1;
	END IF;
	OPEN users_cursor FOR SELECT u.usename AS "имя"
				FROM pg_user u
				WHERE u.usename <> 'test'::name;
	FETCH FIRST FROM users_cursor INTO name;
	WHILE FOUND LOOP
		IF ((SELECT COUNT(*) FROM users WHERE ИМЯ = name) = 0) THEN
			INSERT INTO users (КОД, ИМЯ) VALUES (1000000 + id, name);
			id := id + 1;
		END IF;
		FETCH NEXT FROM users_cursor INTO name;
	END LOOP;
	CLOSE users_cursor;

	OPEN users_cursor FOR SELECT * FROM users;
	FETCH FIRST FROM users_cursor INTO id, name;
	WHILE FOUND LOOP
		ret_row.КОД := id;
		ret_row.ИМЯ := name;
		RETURN NEXT ret_row;
		FETCH NEXT FROM users_cursor INTO id, name;
	END LOOP;
	CLOSE users_cursor;
	
	RETURN;
END;
$$;


ALTER FUNCTION public.sp_get_users() OWNER TO sa;

--
-- TOC entry 423 (class 1255 OID 506910)
-- Name: sp_insertdoc(integer, character varying); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION sp_insertdoc(noper integer, cdate character varying) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
DECLARE 
cNumName "нумераторы"."ИМЯ"%TYPE;		-- Наименование нумератора
	nValue "нумераторы"."ЗНАЧЕНИЕ"%TYPE;	-- Значение нумератора
	dDate DATE;				-- Дата документа
	nDocId "документы"."КОД"%TYPE;
	cNumber "документы"."НОМЕР"%TYPE;
	nUserId "персонал"."КОД"%TYPE;			
BEGIN
	nUserId := (SELECT variable_value::INTEGER FROM session_variables.data WHERE backend_pid = pg_backend_pid() AND variable_name = 'client_user_id');
	cNumName := RTRIM((SELECT "НУМЕРАТОР" FROM "топер" WHERE "ОПЕР" = nOper AND "НОМЕР" = 1 LIMIT 1));	-- Загрузим наименование нумератора
	IF cNumName IS NOT NULL AND char_length(cNumName) > 0 THEN
		nValue := (SELECT "ЗНАЧЕНИЕ" FROM "нумераторы" WHERE RTRIM("ИМЯ") = cNumName LIMIT 1);	-- Получим новое значение нумератора
		nValue := nValue + 1;
		UPDATE "нумераторы" SET "ЗНАЧЕНИЕ" = nValue WHERE RTRIM("ИМЯ") = cNumName;		-- Сохраним новое значение нумератора
		cNumber := trim(leading from to_char(nValue, '999999999'));
	ELSE
		cNumber := '';
	END IF;
	IF cDate IS NULL THEN
		dDate = CURRENT_DATE;
	ELSE
		dDate = to_date(cDate, 'DD.MM.YYYY');
	END IF;
	INSERT INTO "документы" ("ДАТА", "ДАТАВРЕМЯ", "ОПЕР", "НОМЕР", "АВТО", "КОД_ПЕРСОНАЛ") VALUES (dDate, current_timestamp, nOper, cNumber, 0, nUserId) RETURNING "КОД" INTO nDocId;
	IF (SELECT COUNT(*) FROM pg_tables WHERE schemaname = 'public' AND tablename = 'докатрибуты' || rtrim(ltrim(cast(nOper AS VARCHAR(10))))) > 0 THEN
		EXECUTE 'INSERT INTO "докатрибуты' || rtrim(ltrim(cast(nOper AS VARCHAR(10)))) || '" ("КОД") VALUES ($1);' USING nDocId;
	END IF;
	RETURN nDocId;
END;
$_$;


ALTER FUNCTION public.sp_insertdoc(noper integer, cdate character varying) OWNER TO sa;

--
-- TOC entry 424 (class 1255 OID 506911)
-- Name: sp_insertdocstr(integer, integer, character varying, integer, integer); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION sp_insertdocstr(noper integer, ndocid integer, pcparam character varying, pncount integer, pndocstr integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE nNum INTEGER;
	cDbAcc VARCHAR(5);
	cCrAcc VARCHAR(5);
	nDbId INTEGER;
	nCrId INTEGER;
	nQuan NUMERIC(8,3);
	nPrice NUMERIC(14,2);
	nSum NUMERIC(14,2);
	cParam1 VARCHAR(100);
	cParam VARCHAR(100);
	nCount INTEGER;
	nCount1 INTEGER;
	nDocStr INTEGER;
	nFreeCount INTEGER;
	bFreePrv BOOLEAN;
	curResult REFCURSOR;
	cCommand VARCHAR(1000);
	bAttrExist BOOLEAN;
BEGIN
	cParam := pcParam;
	nCount := pnCount;
	nDocStr := pnDocStr;

	IF nCount IS NULL THEN
		nCount := 1;
	END IF;
	IF (SELECT COUNT(*) FROM pg_tables WHERE schemaname = 'public' AND tablename = 'атрибуты' || rtrim(ltrim(cast(nOper AS VARCHAR(10))))) > 0 THEN
		bAttrExist := TRUE;
	ELSE
		bAttrExist := FALSE;
	END IF;
	IF nDocStr IS NULL OR nDocStr = 0 THEN
		-- найдем наибольший "НОМЕР" строки в документе
		nDocStr := (SELECT max(p."СТР") AS max_value FROM "проводки" p WHERE p."ДОККОД" = nDocId AND p."ОПЕР" = noper);
		IF nDocStr IS NULL THEN
			nDocStr := 1;
		ELSE
			nDocStr := nDocStr + 1;
		END IF;
	END IF;
	-- вставим в документ проводки для новой строки
	OPEN curResult FOR SELECT "ДБСЧЕТ", "КРСЧЕТ", "НОМЕР", "НЕЗАВИСИМ"  FROM "топер" WHERE "ОПЕР" = noper ORDER BY "НОМЕР";
	WHILE nCount > 0 LOOP
		-- Проверим, не использует ли документ таблицу атрибутов, и если использует, то добавим строку в таблицу атрибутов
		IF bAttrExist THEN
			EXECUTE 'SELECT COUNT(*) FROM "атрибуты'  || rtrim(ltrim(cast(noper AS VARCHAR(10)))) || '" WHERE "ДОККОД" = ' || nDocId::text || ' AND "СТР" = ' || nDocStr::text INTO nCount1;
			IF nCount1 = 0 THEN
				EXECUTE 'INSERT INTO "атрибуты' || rtrim(ltrim(cast(noper AS VARCHAR(10)))) || '" ("КОД", "ДОККОД", "СТР") VALUES ((SELECT COALESCE((SELECT MAX("КОД") FROM "атрибуты' || rtrim(ltrim(cast(noper AS VARCHAR(10)))) || '"), 0) + 1), ' || nDocId || ', ' || nDocStr || ');';
				
			END IF;
		END IF;
		cParam1 := cParam;
		FETCH first FROM curResult INTO cDbAcc, cCrAcc, nNum, bFreePrv;
		WHILE found LOOP
			IF length(cParam) = 0 THEN
				cParam1 := '0,0,0,0,0,';
			END IF;
			nDbId := to_number(substring(cParam1 FROM 1 FOR position(',' in cParam1) - 1), '999999999');	
			cParam1 := substring(cParam1 FROM position(',' in cParam1) + 1);
			nCrId := to_number(substring(cParam1 FROM 1 FOR position(',' in cParam1) - 1), '999999999');	
			cParam1 := substring(cParam1 FROM position(',' in cParam1) + 1);
			nQuan := to_number(replace(substring(cParam1 FROM 1 FOR position(',' in cParam1) - 1), '.', ','), '99999d999');	
			cParam1 := substring(cParam1 FROM position(',' in cParam1) + 1);
			nPrice := to_number(replace(substring(cParam1 FROM 1 FOR position(',' in cParam1) - 1), '.', ','), '99999999d99');	
			cParam1 := substring(cParam1 FROM position(',' in cParam1) + 1);
			nSum := to_number(replace(substring(cParam1 FROM 1 FOR position(',' in cParam1) - 1), '.', ','), '99999999d99');	
			cParam1 := substring(cParam1 FROM position(',' in cParam1) + 1);
			IF bFreePrv THEN 
				nFreeCount := (SELECT count(*) FROM "проводки" p WHERE p."ДОККОД" = nDocId AND p."ОПЕР" = noper AND p."НОМЕРОПЕР" = nNum);
				IF nFreeCount = 0 THEN
					INSERT INTO "проводки" ("КОД", "ДОККОД", "СТР", "ОПЕР", "НОМЕРОПЕР", "ДБСЧЕТ", "ДБКОД", "КРСЧЕТ", "КРКОД", "КОЛ", "ЦЕНА", "СУММА") 
						VALUES ((SELECT MAX("КОД")+1 FROM "проводки"), nDocId, nDocStr, noper, nNum, cDbAcc, nDbId, cCrAcc, nCrId, nQuan, nPrice, nSum);
				END IF;
			ELSE
				INSERT INTO "проводки" ("КОД", "ДОККОД", "СТР", "ОПЕР", "НОМЕРОПЕР", "ДБСЧЕТ", "ДБКОД", "КРСЧЕТ", "КРКОД", "КОЛ", "ЦЕНА", "СУММА") 
					VALUES ((SELECT MAX("КОД")+1 FROM "проводки"), nDocId, nDocStr, noper, nNum, cDbAcc, nDbId, cCrAcc, nCrId, nQuan, nPrice, nSum);
			END IF;
			FETCH NEXT FROM curResult INTO cDbAcc, cCrAcc, nNum, bFreePrv;
		END LOOP;
		nCount := nCount - 1;
		nDocStr := nDocStr + 1;
	END LOOP;
	nDocStr := nDocStr - 1;
	CLOSE curResult;
RETURN nDocStr;
END;
$$;


ALTER FUNCTION public.sp_insertdocstr(noper integer, ndocid integer, pcparam character varying, pncount integer, pndocstr integer) OWNER TO sa;

--
-- TOC entry 383 (class 1255 OID 506912)
-- Name: sp_islockedperiod(character varying); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION sp_islockedperiod(cdate character varying) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE dDate DATE;
BEGIN
	IF (cDate IS NULL) OR (cDate = '') THEN					-- если дата не указана
		dDate = current_date;				-- то выберем текущую дату
	ELSE
		dDate = to_date(cDate, 'DD.MM.YYYY');
	END IF;
	SELECT b.* 
	FROM блокпериоды b INNER JOIN пользователи u ON b.КОД_ПОЛЬЗОВАТЕЛИ = u.КОД AND u.ИМЯ = current_user 
	WHERE (dDate > b.НАЧАЛО - '1') AND (dDate < b.КОНЕЦ + '1') AND (dDate < b.БЛОККОНЕЦ + '1');
END;
$$;


