--
-- TOC entry 426 (class 1255 OID 506913)
-- Name: sp_maketotobjoborotcommand(character varying, character varying, integer, character varying, character varying); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION sp_maketotobjoborotcommand(cacc character varying, pcdictname character varying, pnobj integer, cdate1 character varying, cdate2 character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE cSetName VARCHAR(50);
	cCommand VARCHAR(8000);
	cDictName VARCHAR (50);
	nObj INTEGER;
BEGIN
	cDictName = UPPER(pcDictName);
	nObj = COALESCE(pnObj, 0);
	cSetName = (SELECT ИМЯСПРАВОЧНИКА FROM счета WHERE СЧЕТ = cAcc);
	cSetName = RTRIM(cSetName);

	cCommand = 'SELECT КОД FROM ' || cSetName || ' WHERE КОД_' || cDictName || '=' || RTRIM(LTRIM(CAST(nObj AS VARCHAR(20))));
	cCommand = 'SELECT ДАТА, ОПЕРНОМЕР, ОПЕРИМЯ, ДБСЧЕТ, КРСЧЕТ, SUM(ДБКОЛ) AS ДБКОЛ, SUM(ДЕБЕТ) AS ДЕБЕТ, SUM(КРКОЛ) AS КРКОЛ, SUM(КРЕДИТ) AS КРЕДИТ '
		 || 'FROM (SELECT to_date("' || cDate1 || '", "DD.MM.YYYY") AS ДАТА, 0 AS ОПЕРНОМЕР, "" AS ОПЕРИМЯ, "" AS ДБСЧЕТ, "" AS КРСЧЕТ, '
			       || 'ДБКОЛ = CASE '
			               || 'WHEN S.КОЛ > 0 THEN S.КОЛ '
	        		       || 'ELSE 0 '
			               || 'END, '
			       || 'ДЕБЕТ = CASE '
        			       || 'WHEN S.САЛЬДО > 0 THEN S.САЛЬДО '
			               || 'ELSE 0 '
			               || 'END, '
			       || 'КРКОЛ = CASE '
			               || 'WHEN S.КОЛ < 0 THEN -S.КОЛ '
        			       || 'ELSE 0 '
			               || 'END, '
			       || 'КРЕДИТ = CASE '
	        		        || 'WHEN S.САЛЬДО < 0 THEN -S.САЛЬДО '
			                || 'ELSE 0 '
			                || 'END '
			 || 'FROM (SELECT (S.КОЛ + COALESCE(P1.КОЛ, 0) - COALESCE(P2.КОЛ, 0)) AS КОЛ, (S.САЛЬДО + COALESCE(P1.СУММА, 0) - COALESCE(P2.СУММА, 0)) AS САЛЬДО '
 		        	     || 'FROM (SELECT КОД, COALESCE(КОЛ, 0) AS КОЛ, COALESCE(САЛЬДО, 0) AS САЛЬДО '
				     || 'FROM сальдо WHERE СЧЕТ = "' || cAcc || '" AND КОД IN (' || cCommand || ') '
     		        		             || ') S LEFT OUTER JOIN (SELECT P.ДБКОД AS КОД, SUM(COALESCE(P.КОЛ, 0)) AS КОЛ, SUM(COALESCE(P.СУММА, 0)) AS СУММА '
     	               		        		                  || 'FROM проводки P INNER JOIN документы D ON P.ДОККОД=D.КОД '
                	                       		        		  || 'WHERE P.ДБСЧЕТ = "' || cAcc || '" AND COALESCE(P.ДБКОД, 0) IN (' || cCommand || ') AND to_date(D.ДАТА, "DD.MM.YYYY") < to_date("' || cDate1 || '", "DD.MM.YYYY") '
	                	                                       		  || 'GROUP BY P.ДБКОД) P1 ON S.КОД = P1.КОД '
			        	                     	 || 'LEFT OUTER JOIN (SELECT P.КРКОД AS КОД, SUM(COALESCE(P.КОЛ, 0)) AS КОЛ, SUM(COALESCE(P.СУММА, 0)) AS СУММА '
	               				                                  || 'FROM проводки P INNER JOIN документы D ON P.ДОККОД=D.КОД '
        	                				                  || 'WHERE P.КРСЧЕТ = "' || cAcc || '" AND COALESCE(P.КРКОД, 0) IN (' || cCommand || ') AND to_date(D.ДАТА, "DD.MM.YYYY") < to_date("' || cDate1 || '", "DD.MM.YYYY") '
				                                		  || 'GROUP BY P.КРКОД) P2 ON S.КОД = P2.КОД '
				     		      || ') S '
						|| 'UNION '
						|| 'SELECT D.ДАТАВРЕМЯ AS ДАТА, D.ОПЕР AS ОПЕРНОМЕР, T.ИМЯ AS ОПЕРИМЯ, "' || cAcc || '" AS ДБСЧЕТ, P.КРСЧЕТ, COALESCE(P.КОЛ, 0) AS ДБКОЛ, COALESCE(P.СУММА, 0) AS ДБСУММА, 0 AS КРКОЛ, 0 AS КРСУММА '
						|| 'FROM проводки P INNER JOIN документы D ON P.ДОККОД=D.КОД '
               							               || 'INNER JOIN топер T ON P.ОПЕР = T.ОПЕР AND T.НОМЕР = 1 '
						|| 'WHERE P.ДБСЧЕТ <> P.КРСЧЕТ AND P.ДБСЧЕТ = "' || cAcc || '" AND P.ДБКОД IN (' || cCommand || ') AND (P.КОЛ <> 0 OR P.СУММА <> 0) AND (to_date(D.ДАТА, "DD.MM.YYYY") >= to_date("' || cDate1 || '", "DD.MM.YYYY")) AND (to_date(D.ДАТА, "DD.MM.YYYY") < to_date("' || cDate2 || '", "DD.MM.YYYY") + 1) '
						|| 'UNION '
						|| 'SELECT D.ДАТАВРЕМЯ AS ДАТА, D.ОПЕР AS ОПЕРНОМЕР, T.ИМЯ AS ОПЕРИМЯ, P.ДБСЧЕТ, "' || cAcc || '" AS КРСЧЕТ, 0 AS ДБКОЛ, 0 AS ДБСУММА, COALESCE(P.КОЛ, 0) AS КРКОЛ, COALESCE(P.СУММА, 0) AS КРСУММА '
						|| 'FROM проводки P INNER JOIN документы D ON P.ДОККОД=D.КОД '
               							               || 'INNER JOIN топер T ON P.ОПЕР = T.ОПЕР AND T.НОМЕР = 1 '
						|| 'WHERE P.ДБСЧЕТ <> P.КРСЧЕТ AND P.КРСЧЕТ = "' || cAcc || '" AND P.КРКОД IN (' || cCommand || ') AND (P.КОЛ <> 0 OR P.СУММА <> 0) AND (to_date(D.ДАТА, "DD.MM.YYYY") >= to_date("' || cDate1 || '", "DD.MM.YYYY")) AND (to_date(D.ДАТА, "DD.MM.YYYY") < to_date("' || cDate2 || '", "DD.MM.YYYY") + 1) '
						|| ') S '
					|| 'GROUP BY ДАТА, ОПЕРНОМЕР, ОПЕРИМЯ, ДБСЧЕТ, КРСЧЕТ';
	RETURN cCommand;
END;
$$;


ALTER FUNCTION public.sp_maketotobjoborotcommand(cacc character varying, pcdictname character varying, pnobj integer, cdate1 character varying, cdate2 character varying) OWNER TO sa;

--
-- TOC entry 384 (class 1255 OID 506914)
-- Name: sp_pricesearch(integer, character varying); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION sp_pricesearch(firmid integer, expr character varying) RETURNS SETOF sp_pricesearch_fret
    LANGUAGE plpgsql
    AS $$
DECLARE ret_row sp_pricesearch_fret%ROWTYPE;
	splittedname VARCHAR(100);
	maxrank REAL;
	word VARCHAR(100);
	words REFCURSOR;
	
BEGIN
	CREATE TEMP TABLE __temp__ (КОД INTEGER, ВЕС REAL);

	splittedname := lower(splitname(expr));
	
	INSERT INTO __temp__ (КОД, ВЕС) 
	SELECT p.КОД, ts_rank_cd(fts, query) AS ВЕС
	FROM vw_прайс p, to_tsquery(replace(splittedname, ' ', '|')) query
	WHERE p.КОД_ФИРМЫ = firmid AND (fts @@ query)
	ORDER BY ВЕС DESC;
			  
	-- Найдем максимальное значение совпадений
	SELECT MAX(ВЕС) FROM __temp__ INTO maxrank;

	-- Не будем возвращать строки, в которых совпадений мало (меньше половины)
	DELETE FROM __temp__ WHERE ВЕС <= maxrank / 2;
	
	FOR ret_row IN SELECT t.КОД, t.ВЕС, 0, p.ИМЯ || ' ' || p.ШИФР_ПО_КАТАЛОГУ AS ИМЯ, p.ЕДИЗМ
			FROM __temp__ t INNER JOIN прайс p ON t.КОД = p.КОД
			ORDER BY t.ВЕС DESC 
	LOOP
		OPEN words FOR SELECT regexp_split_to_table(splittedname, E'\\s+');			
		LOOP
			FETCH words INTO word;	
			EXIT WHEN NOT FOUND;			-- Если больше нет позиций, то выход
			IF strpos(lower(ret_row.ИМЯ), word) > 0 THEN
				ret_row.СОВПАДЕНИЯ := ret_row.СОВПАДЕНИЯ + 1;
			END IF;
		END LOOP;
		CLOSE words;
		
		RETURN NEXT ret_row;
	END LOOP;
	DROP TABLE __temp__;
	RETURN;
END;
$$;


ALTER FUNCTION public.sp_pricesearch(firmid integer, expr character varying) OWNER TO sa;

--
-- TOC entry 385 (class 1255 OID 506915)
-- Name: sp_tovarsearch(character varying); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION sp_tovarsearch(expr character varying) RETURNS SETOF sp_tovarsearch_fret
    LANGUAGE plpgsql
    AS $_$
DECLARE ret_row sp_tovarsearch_fret%ROWTYPE;
	maxquan INTEGER;
	word VARCHAR(100);
	words REFCURSOR;
BEGIN
	CREATE TEMP TABLE __temp__ (КОД INTEGER, QUAN INTEGER);		  
	OPEN words FOR SELECT regexp_split_to_table(lower(splitname(expr, FALSE)), E'\\s+');			
	LOOP
		FETCH words INTO word;
		EXIT WHEN NOT FOUND;			-- Если больше нет позиций, то выход
		
		IF word ~ '^\d+$' THEN			-- Если это у нас цифровое выражение
			INSERT INTO __temp__ (КОД, QUAN) 
			SELECT КОД, 2
			FROM товар
			WHERE (ИМЯ || ШИФР_ПО_КАТАЛОГУ ILIKE '%' || word || '%');
		ELSE
			INSERT INTO __temp__ (КОД, QUAN) 
			SELECT КОД, 1
			FROM товар
			WHERE (fts @@ to_tsquery(word));
		END IF;
	END LOOP;	
	CLOSE words;

	CREATE TEMP TABLE __temp1__ AS SELECT t.КОД, SUM(QUAN) AS QUAN
					FROM __temp__ t     
					GROUP BY t.КОД;
	SELECT MAX(QUAN) FROM __temp1__ INTO maxquan;
		FOR ret_row IN SELECT t.КОД, t.QUAN
		FROM __temp1__ t
		WHERE t.QUAN > maxquan / 2
		ORDER BY t.QUAN DESC LOOP
		RETURN NEXT ret_row;
	END LOOP;
	DROP TABLE __temp1__;
	DROP TABLE __temp__;
	RETURN;
END;
$_$;


ALTER FUNCTION public.sp_tovarsearch(expr character varying) OWNER TO sa;

--
-- TOC entry 386 (class 1255 OID 506916)
-- Name: sp_updateprice(); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION sp_updateprice() RETURNS void
    LANGUAGE plpgsql
    AS $$
declare
	_id_firm 	last_price.id_firm%TYPE;
	_id 		last_price.id%TYPE;
	_name 		last_price.name%TYPE;
	_katalog	last_price.katalog%TYPE;
	_articul	last_price.articul%TYPE;
	_unit		last_price.unit%TYPE;
	_price		last_price.price%TYPE;
	_max_price	last_price.max_price%TYPE;
	_upak		last_price.upak%TYPE;
	_nalich		last_price.nalich%TYPE;
	_proizv		last_price.proizv%TYPE;
	_photo_url	last_price.photo_url%TYPE;
	curtemp 	refcursor;
	priceId		прайс.КОД%TYPE;
begin
	open curtemp for
		SELECT id_firm, id, name, katalog, articul, unit, price, max_price, upak, nalich, proizv, photo_url FROM last_price WHERE price <> 0 OR max_price <> 0;
	fetch first from curtemp into _id_firm, _id, _name, _katalog, _articul, _unit, _price, _max_price, _upak, _nalich, _proizv, _photo_url;
	while found loop
		_id = trim(_id);
		_name = trim(_name);
		IF char_length(_id) > 0 THEN
			IF (SELECT COUNT(*) FROM прайс WHERE КОД_ФИРМЫ = _id_firm AND КОДВПРАЙСЕ = _id) > 0 THEN
				UPDATE прайс SET ИМЯ = _name, ШИФР_ПО_КАТАЛОГУ = substring(_katalog from 1 for 20), ЕДИЗМ = _unit, МИНЦЕНА = _price, МАКСЦЕНА = _max_price, УПАКОВКА = _upak, НАЛИЧИЕ = _nalich, ДАТА = current_date, ПРОИЗВОДИТЕЛЬ = _proizv, АРТИКУЛ = _articul, РОСТЦЕНЫ = round((_price - МИНЦЕНА) * 100 / МИНЦЕНА, 2), "PHOTO_URL" = _photo_url WHERE КОД_ФИРМЫ = _id_firm AND КОДВПРАЙСЕ = _id AND МИНЦЕНА <> 0;
			ELSE
				INSERT INTO прайс (ИМЯ, ШИФР_ПО_КАТАЛОГУ, ЕДИЗМ, МИНЦЕНА, МАКСЦЕНА, УПАКОВКА, НАЛИЧИЕ, КОД_ФИРМЫ, КОДВПРАЙСЕ, ДАТА, ПРОИЗВОДИТЕЛЬ, АРТИКУЛ, "PHOTO_URL") VALUES (_name, substring(_katalog from 1 for 20), _unit, _price, _max_price, _upak, _nalich, _id_firm, _id, current_date, _proizv, _articul, _photo_url);
			END IF;
		ELSE
			IF char_length(_name) > 0 THEN
				priceId = (SELECT КОД FROM прайс WHERE КОД_ФИРМЫ = _id_firm AND (strpos(ИМЯ, _name) > 0 OR strpos(_name, ИМЯ) > 0) LIMIT 1);
				IF priceId IS NOT NULL THEN
					UPDATE прайс SET КОДВПРАЙСЕ = _id, ИМЯ = _name, ШИФР_ПО_КАТАЛОГУ = substring(_katalog from 1 for 20), ЕДИЗМ = _unit, МИНЦЕНА = _price, МАКСЦЕНА = _max_price, УПАКОВКА = _upak, НАЛИЧИЕ = _nalich, ДАТА = current_date, ПРОИЗВОДИТЕЛЬ = _proizv, АРТИКУЛ = _articul, РОСТЦЕНЫ = round((_price - МИНЦЕНА) * 100 / МИНЦЕНА, 2), "PHOTO_URL" = _photo_url WHERE КОД = priceId AND МИНЦЕНА <> 0;
				ELSE					
					INSERT INTO прайс (ИМЯ, ШИФР_ПО_КАТАЛОГУ, ЕДИЗМ, МИНЦЕНА, МАКСЦЕНА, УПАКОВКА, НАЛИЧИЕ, КОД_ФИРМЫ, КОДВПРАЙСЕ, ДАТА, ПРОИЗВОДИТЕЛЬ, АРТИКУЛ, "PHOTO_URL") VALUES (_name, substring(_katalog from 1 for 20), _unit, _price, _max_price, _upak, _nalich, _id_firm, _id, current_date, _proizv, _articul, _photo_url);
				END IF;	
			END IF;
		END IF;
		fetch next from curtemp into _id_firm, _id, _name, _katalog, _articul, _unit, _price, _max_price, _upak, _nalich, _proizv, _photo_url;
	end loop;
	close curtemp;
end;
$$;


