-- Name: sp_заказатьтовар(integer); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION "sp_заказатьтовар"(nid integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
	nOstQuan "сальдо"."КОНКОЛ"%TYPE;
	nZapasQuan "товар"."ЗАПАС"%TYPE;
	nMinZapas "сальдо"."КОНКОЛ"%TYPE;
	nBrakQuan "сальдо"."КОНКОЛ"%TYPE;
	nZakaz 	"сальдо"."КОНКОЛ"%TYPE;
	nGroupId "товар"."КОД_ГРУППЫ"%TYPE;
BEGIN
	nOstQuan := (SELECT COALESCE(SUM("КОНКОЛ"), 0) 
		     FROM "сальдо" 
		     WHERE "СЧЕТ" = '411' AND "КОД" IN (SELECT "КОД" 
			   			    FROM "набор1" WHERE "КОД_ТОВАР" = nId
						    )
		     );
	nBrakQuan := (SELECT COALESCE(SUM("КОНКОЛ"), 0) 
		     FROM "сальдо" 
		     WHERE "СЧЕТ" = '411' AND "КОД" IN (SELECT "КОД" 
			   			    FROM "набор1" WHERE "КОД_ТОВАР" = nId AND "КОД_АДРЕС" = (SELECT "КОД" 
													FROM "адрес" 
													WHERE "ИМЯ" ILIKE '%Брак%')
						    )
		     );
	nOstQuan := nOstQuan - nBrakQuan;	     
	nZapasQuan := (SELECT COALESCE("ЗАПАС", 0) FROM "товар" WHERE "КОД" = nId LIMIT 1);
	nMinZapas := (SELECT to_number("ЗНАЧЕНИЕ", '999') FROM "константы" WHERE trim("ИМЯ") = 'УровеньЗаказа'); 
	nMinZapas := nZapasQuan * nMinZapas / 100;
--	RAISE EXCEPTION 'nOstQuan = %, nMinZapas = %', nOstQuan, nMinZapas;
	IF nMinZapas > 0 AND nMinZapas < 1 THEN
		nMinZapas = 1;
	END IF;
	IF nMinZapas > 0 AND nOstQuan <= nMinZapas THEN
		IF (SELECT COUNT(*) FROM "заявка" WHERE "КОД_ТОВАР" = nId) > 0 THEN
			IF (SELECT "МОДИФИЦИРОВАНО" FROM "заявка" WHERE "КОД_ТОВАР" = nId LIMIT 1) IS NOT TRUE THEN
				IF (nZapasQuan - nOstQuan) > 0 THEN
					UPDATE "заявка" SET "КОЛ" = nZapasQuan - nOstQuan, "КОЛ_ОБРАБОТАННОЕ" = nZapasQuan - nOstQuan, "ДАТАЗАЯВКИ" = current_date WHERE "КОД_ТОВАР" = nId;
				ELSE
					DELETE FROM "заявка" WHERE "КОД_ТОВАР" = nId;
				END IF;
			ELSE
				nZakaz := (SELECT "КОЛ" FROM "заявка" WHERE "КОД_ТОВАР" = nId LIMIT 1);
				IF (nZakaz < nZapasQuan - nOstQuan) THEN
					nZakaz := nZapasQuan - nOstQuan;
				END IF;
				UPDATE "заявка" SET "КОЛ" = nZakaz WHERE "КОД_ТОВАР" = nId;
			END IF;
		ELSE
			IF (nZapasQuan - nOstQuan) > 0 THEN
				nGroupId := (SELECT "КОД_ГРУППЫ" FROM "товар" WHERE "КОД" = nId);
				INSERT INTO "заявка" ("КОД_ТОВАР", "КОД_ГРУППЫ", "КОЛ", "ДАТАЗАЯВКИ") VALUES (nId, nGroupId, nZapasQuan - nOstQuan, current_date);
			END IF;
		END IF;
	ELSE
		IF (SELECT COUNT(*) FROM "заявка" WHERE "КОД_ТОВАР" = nId AND NOT "МОДИФИЦИРОВАНО") > 0 THEN
			DELETE FROM "заявка" WHERE "КОД_ТОВАР" = nId;
		END IF;
	END IF;
	RETURN;
END;
$$;


ALTER FUNCTION public."sp_заказатьтовар"(nid integer) OWNER TO sa;

