CREATE FUNCTION "sp_распределитьзаказ"(cfirmlist character varying) RETURNS void
    LANGUAGE plpgsql
    AS $$
declare cCommand varchar(8000);
begin
	DELETE FROM заявка WHERE МОДИФИЦИРОВАНО = True AND ДАТАОБРАБОТКИ < current_date - 90;
	cCommand = 'UPDATE заявка z SET КОД_ФИРМЫ = s.КОД_ФИРМЫ, КОДВПРАЙСЕ = s.КОДВПРАЙСЕ, ИМЯВПРАЙСЕ = s.ИМЯ, ЕДИЗМВПРАЙСЕ = s.ЕДИЗМ, ЦЕНА = s.ЦЕНА, ДАТАОБРАБОТКИ = current_date, КОЛ_ОБРАБОТАННОЕ = round(КОЛ*s.КОЛ_ПРАЙС/s.КОЛ_ТОВАР), ЦЕНА_ОБРАБОТАННАЯ=s.ЦЕНА_ОБРАБОТАННАЯ, НАЛИЧИЕ = s.НАЛИЧИЕ
		FROM (SELECT p.*, s.ЦЕНА, p.МИНЦЕНА AS ЦЕНА_ОБРАБОТАННАЯ
		      FROM прайс p INNER JOIN (SELECT p.КОД_ТОВАР, MIN(p.МИНЦЕНА*p.КОЛ_ПРАЙС/p.КОЛ_ТОВАР)::numeric(12, 2) AS ЦЕНА
					       FROM (SELECT *
						   FROM прайс p INNER JOIN "vw_блокпериоды" b ON p."ДАТА" > (b."НАЧАЛО" - 1) AND p."ДАТА" < (b."КОНЕЦ" + 1)
						   
						   WHERE p.КОД_ТОВАР IN (SELECT КОД_ТОВАР 
									FROM заявка 
									WHERE COALESCE(КОД_ФИРМЫ, 0) = 0) AND
							p.КОД_ФИРМЫ IN (' || cFirmList || ') AND
							p.ДАТА >= (SELECT current_date - to_number(ЗНАЧЕНИЕ, ''9999'')::integer 
								   FROM константы  
								   WHERE trim(ИМЯ) = ''АктуальностьПрайсов'') AND
							p.НАЛИЧИЕ = ''+'' AND
							p.ПРИОРИТЕТ = 1
						  ) p
						GROUP BY p.КОД_ТОВАР) s
			ON p.КОД_ТОВАР = s.КОД_ТОВАР AND (p.МИНЦЕНА*p.КОЛ_ПРАЙС/p.КОЛ_ТОВАР)::numeric(12, 2) = s.ЦЕНА AND p.КОД_ФИРМЫ IN (' || cFirmList || ')
			) s WHERE COALESCE(z.КОД_ТОВАР, 0) > 0 AND z.КОД_ТОВАР = s.КОД_ТОВАР';
	EXECUTE cCommand;
	cCommand = 'UPDATE заявка z SET КОД_ФИРМЫ = s.КОД_ФИРМЫ, КОДВПРАЙСЕ = s.КОДВПРАЙСЕ, ИМЯВПРАЙСЕ = s.ИМЯ, ЕДИЗМВПРАЙСЕ = s.ЕДИЗМ, ЦЕНА = s.ЦЕНА, ДАТАОБРАБОТКИ = current_date, КОЛ_ОБРАБОТАННОЕ = round(КОЛ*s.КОЛ_ПРАЙС/s.КОЛ_ТОВАР), ЦЕНА_ОБРАБОТАННАЯ=s.ЦЕНА_ОБРАБОТАННАЯ, НАЛИЧИЕ = s.НАЛИЧИЕ
		FROM (SELECT p.*, s.ЦЕНА, p.МИНЦЕНА AS ЦЕНА_ОБРАБОТАННАЯ
		      FROM прайс p INNER JOIN (SELECT p.КОД_ТОВАР, MIN(p.МИНЦЕНА*p.КОЛ_ПРАЙС/p.КОЛ_ТОВАР)::numeric(12, 2) AS ЦЕНА
					       FROM (SELECT *
						   FROM прайс p INNER JOIN "vw_блокпериоды" b ON p."ДАТА" > (b."НАЧАЛО" - 1) AND p."ДАТА" < (b."КОНЕЦ" + 1)
						   
						   WHERE p.КОД_ТОВАР IN (SELECT КОД_ТОВАР 
									FROM заявка 
									WHERE COALESCE(КОД_ФИРМЫ, 0) = 0) AND
							p.КОД_ФИРМЫ IN (' || cFirmList || ') AND
							p.ДАТА >= (SELECT current_date - to_number(ЗНАЧЕНИЕ, ''9999'')::integer 
								   FROM константы  
								   WHERE trim(ИМЯ) = ''АктуальностьПрайсов'') AND
							p.НАЛИЧИЕ = ''-'' AND
							p.ПРИОРИТЕТ = 1
						  ) p
						GROUP BY p.КОД_ТОВАР) s
			ON p.КОД_ТОВАР = s.КОД_ТОВАР AND (p.МИНЦЕНА*p.КОЛ_ПРАЙС/p.КОЛ_ТОВАР)::numeric(12, 2) = s.ЦЕНА AND p.КОД_ФИРМЫ IN (' || cFirmList || ')
			) s WHERE COALESCE(z.КОД_ТОВАР, 0) > 0 AND z.КОД_ТОВАР = s.КОД_ТОВАР';
	EXECUTE cCommand;
end;
$$;


