--
-- TOC entry 388 (class 1255 OID 506919)
-- Name: splitname(character varying, character varying); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION splitname(pcname character varying, pctable character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $_$
DECLARE 
	cName VARCHAR(255);		-- Наименование позиции, которую предстоит разобрать
	cResName VARCHAR(255);
	cWord VARCHAR(255);
	synonyms синонимы%ROWTYPE;
	synwords VARCHAR(255);
	command  VARCHAR(10000);
	pos	INTEGER;
BEGIN
	cName := lower(pcname);
	synwords := '';
	LOOP	
		cWord := substring(cName from '[0-9A-Za-zА-Яа-я]+');	-- Читаем первое слово (до первого пробела)
		IF cWord IS NULL THEN		-- Слова закончились, выходим
			EXIT;
		END IF;
		IF length(cWord) > 0 THEN
			FOR synonyms IN SELECT * FROM синонимы WHERE "FTS" @@ to_tsquery(cWord)
			LOOP
				synwords := synwords || ' ' || synonyms.ИМЯ || ' ' || synonyms.ИМЯ1;
			END LOOP;
		END IF;
		cName := ltrim(substring(cName from length(cWord) + 1));		-- Убираем проверенное слово из исходного выражения
	END LOOP;
	cName = pcname || synwords;
	cName := lower(cName);
	cName := replace(cName, '"', ' ');
	cName := replace(cName, '+', ' ');
	cName := replace(cName, '*', ' ');
	cName := replace(cName, '=', ' ');
	cName := replace(cName, '.', ' ');
	cName := replace(cName, '(', ' ');
	cName := replace(cName, ')', ' ');
	cName := replace(cName, ',', ' ');
	cName := replace(cName, '/', ' ');
	cName := replace(cName, '-', ' ');
	cName := replace(cName, ':', ' ');
	cName := replace(cName, '<', ' ');
	cName := replace(cName, '>', ' ');
	cName := replace(cName, ';', ' ');
	-- Уберем повторы
	cResName := '';
	command := '';
	pos := 1;
	LOOP
		cWord := (regexp_split_to_array(cName, E'\\s+'))[1];
--		cWord := substring(cName from '^.+[ ]');	-- Читаем первое слово (до первого пробела)
		IF length(cWord) > 0 THEN
			cName := ltrim(substring(cName from length(cWord) + 1));	-- Убираем его из исходного выражения
			cWord := trim(strip(to_tsvector(cWord))::varchar, '''');
			IF strpos(cResName, cWord) = 0 THEN
				cResName := cResName || cWord || ' ';			-- и записываем в результирующее выражение
				RAISE NOTICE '%', cWord;
				IF length(command) > 0 THEN
					command := command || ' UNION ALL ';
				END IF;
--				command := command || 'SELECT КОД, ''' || cWord || ''' AS ИМЯ FROM ' || pctable || ' WHERE ''' || cWord || ''' @@@ FTS';
--				command := command || 'SELECT КОД, ''' || cWord || ''' AS ИМЯ FROM ' || pctable || ' WHERE to_tsquery(''' || cWord || ''') @@@ FTS';
				command := command || 'SELECT p.КОД, ';
				IF pos = 1 THEN
					command := command || '4 AS ВЕС';
				ELSE
					IF pos = 2 THEN
						command := command || '3 AS ВЕС';
					ELSE
						IF cWord ~ '^[0-9]+$' THEN
							command := command || '2 AS ВЕС';
						ELSE
							command := command || '1 AS ВЕС';
						END IF;
					END IF;
				END IF;
				command := command || ' FROM (SELECT ''' || cWord || '''::text AS ИМЯ) a INNER JOIN ' || pctable || ' p ON to_tsquery(a.ИМЯ) @@@ p.FTS LEFT OUTER JOIN синонимы s ON to_tsquery(a.ИМЯ) @@@ s."FTS"';
			END IF;
		ELSE
			EXIT;
		END IF;
		pos := pos + 1;
	END LOOP;
	command := 'SELECT p.КОД, p.ИМЯ, s.ВЕС FROM (SELECT КОД, SUM(ВЕС) AS ВЕС FROM (' || command || ') s GROUP BY КОД) s INNER JOIN ' || pctable || ' p ON s.КОД = p.КОД ORDER BY s.ВЕС DESC, p.ИМЯ';
	RETURN trim(command);
END;
$_$;


