--
-- TOC entry 401 (class 1255 OID 506932)
-- Name: ПредотвратитьПовторВТС(); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION "ПредотвратитьПовторВТС"() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DEClARE
	nFirmId		"товар_товарвпрайсах"."КОД_ФИРМЫ"%TYPE;
	cInPriceCode	"товар_товарвпрайсах"."КОДВПРАЙСЕ"%TYPE;
	cName		"товар"."ИМЯ"%TYPE;
BEGIN
	nFirmId := NEW."КОД_ФИРМЫ";
	cInPriceCode := rtrim(NEW."КОДВПРАЙСЕ");
	IF char_length(cInPriceCode) > 0 THEN
		IF (SELECT count("КОДВПРАЙСЕ") FROM "товар_товарвпрайсах" WHERE "КОД_ФИРМЫ" = nFirmId) = 0 THEN
			RETURN NEW;
		ELSE
			cName := (SELECT "ИМЯ" FROM "товар" WHERE "КОД" = NEW."КОД_ТОВАР");
			cName := rtrim(cName);
			RAISE WARNING 'Эта позиция в прайсе уже сопоставлена позиции <%> в справочнике товаров.', cName;
			RETURN NULL;
		END IF;
	ELSE
		RETURN NULL;
	END IF;
END;
$$;


