--
-- TOC entry 406 (class 1255 OID 506937)
-- Name: прайс_search(character varying); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION "прайс_search"(pcname character varying) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE 
	cName VARCHAR(255);
	cWord VARCHAR(255);
	i INTEGER;
	nAvgWeight NUMERIC(6, 3);	-- Средний вес
BEGIN
	DELETE FROM search_tmp;
	cName := SplitName(pcName, FALSE) || ' ';
	i := 1;
	LOOP
		cWord := rtrim(substring(cName from '^[a-zA-Zа-яА-Я0-9,]+[ ]{1}'));	-- Возьмем слово из предложения
		IF cWord IS NULL THEN
			EXIT;
		END IF;
		IF cWord ~ '^[0-9,]+' THEN	-- если слово начинается с цифр
			EXECUTE 'INSERT INTO search_tmp SELECT КОД, ВЕС FROM (SELECT КОД, 1 AS ВЕС FROM прайс_search WHERE СЛОВО = \'' || cWord || '\') s;';
		ELSE
			EXECUTE 'INSERT INTO search_tmp SELECT КОД, ВЕС FROM (SELECT КОД, round(1.0/НОМЕР, 3) AS ВЕС FROM прайс_search WHERE СЛОВО = \'' || cWord || '\') s WHERE ВЕС <= round(' || '1.0/' || ltrim(to_char(i, '999')) || ', 3);';
		END IF;
		cName := ltrim(substring(cName from length(cWord) + 1));
		i := i + 1;
	END LOOP;
	RETURN;
END;
$$;


ALTER FUNCTION public."прайс_search"(pcname character varying) OWNER TO sa;

--
-- TOC entry 407 (class 1255 OID 506938)
