--

CREATE FUNCTION "прайс_search1"(pcname character varying) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE 
	nAvgWeight NUMERIC(6, 3);	-- Средний вес
BEGIN
	PERFORM прайс_Search(pcName);
	EXECUTE 'SELECT AVG(ВЕС) FROM (SELECT КОД, SUM(ВЕС) AS ВЕС FROM search_tmp GROUP BY КОД) s WHERE ВЕС >= 1;', nAvgWeight;
