CREATE FUNCTION "проверитьповторнаименования"() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
begin
	if length(trim(new."ИМЯ")) > 0 and (SELECT COUNT(*) FROM "товар" WHERE "ИМЯ" = new."ИМЯ" AND "КОД" <> new."КОД") > 0 then	-- Если есть остатки товара
		raise exception 'Позиция в справочнике точно с таким же наименованием уже существует.';
		return old;
	end if;
	return new;
end;
$$;


