--
-- TOC entry 409 (class 1255 OID 506940)
-- Name: проверитьцену(); Type: FUNCTION; Schema: public; Owner: sa
--

CREATE FUNCTION "проверитьцену"() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
begin
	return new;
	if (old."ЦЕНА" <> new."ЦЕНА") AND (SELECT "КОНСАЛЬДО"/"КОНКОЛ" AS "ЦЕНА" FROM "vw_saldo411" WHERE "КОНКОЛ" <> 0 AND "КОД_ТОВАР" = new."КОД" LIMIT 1) <> new."ЦЕНА" then	-- Если есть остатки товара
		raise exception 'old.ЦЕНА=%, new.ЦЕНА=%. Запрещено изменять цену, т.к. имеются остатки данного наименования и новая цена в справочнике не соответствует цене остатков. Воспользуйтесь операцией <Наценка/уценка>.', old.ЦЕНА, new.ЦЕНА;
		return old;
	end if;
	return new;
end;
$$;


ALTER FUNCTION public."проверитьцену"() OWNER TO sa;

