    u."ИМЯ",
    COALESCE(b."БЛОККОНЕЦ", ('now'::text)::date) AS "БЛОККОНЕЦ",
    COALESCE(b."НАЧАЛО", (('now'::text)::date - 31)) AS "НАЧАЛО",
