                                  WHERE (((d_2."ОПЕР" = ANY (ARRAY[1, 11])) AND (d_2."ДАТА" >= bp."НАЧАЛО")) AND (d_2."ДАТА" <= bp."КОНЕЦ"))) d_1 ON (((p_1."ДОККОД" = d_1."КОД") AND (p_1."НОМЕРОПЕР" = (2)::numeric))))) p2 ON (((p1."ДОККОД" = p2."ДОККОД") AND (p1."СТР" = p2."СТР"))))
                     LEFT JOIN ( SELECT p_1."КОД",
