            "vw_продажи_товара_за_период"."ЕДИЗМ",
            sum("vw_продажи_товара_за_период"."КОЛ") AS "КОЛ",
            sum("vw_продажи_товара_за_период"."ПРОДСУММА") AS "ПРОДСУММА",
