           FROM "vw_продажи_товара_за_период"
          WHERE ("vw_продажи_товара_за_период"."КОЛ" > (0)::numeric)
          GROUP BY "vw_продажи_товара_за_период"."КОД_ГРУППЫ", "vw_продажи_товара_за_период"."ИМЯ", "vw_продажи_товара_за_период"."КОД_ТОВАР", "vw_продажи_товара_за_период"."НАИМЕНОВАНИЕ", "vw_продажи_товара_за_период"."ШИФР_ПО_КАТАЛОГУ", "vw_продажи_товара_за_период"."ЕДИЗМ") s
  ORDER BY s."ПРИБЫЛЬ" DESC;


