--
-- TOC entry 211 (class 1259 OID 507146)
-- Name: vw_types; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW vw_types AS
 SELECT dummy.oid AS "КОД",
    dummy.typname AS "ИМЯ",
    dummy.typname_orig AS "ТИП",
    dummy.typlen AS "ДЛИНА"
   FROM ( SELECT format_type(t.oid, NULL::integer) AS typname,
            t.typname AS typname_orig,
                CASE
                    WHEN (t.typelem > (0)::oid) THEN t.typelem
                    ELSE t.oid
                END AS elemoid,
            t.typlen,
            t.typtype,
            t.oid,
            nsp.nspname,
            (( SELECT count(1) AS count
                   FROM pg_type t2
                  WHERE (t2.typname = t.typname)) > 1) AS isdup
           FROM (pg_type t
             JOIN pg_namespace nsp ON ((t.typnamespace = nsp.oid)))
          WHERE ((((((NOT ((t.typname = 'unknown'::name) AND (nsp.nspname = 'pg_catalog'::name))) AND t.typisdefined) AND (t.typtype = ANY (ARRAY['b'::"char", 'c'::"char", 'd'::"char", 'e'::"char"]))) AND (NOT (EXISTS ( SELECT 1
                   FROM pg_class
                  WHERE (((pg_class.relnamespace = t.typnamespace) AND (pg_class.relname = t.typname)) AND (pg_class.relkind <> 'c'::"char")))))) AND ((t.typname !~~ '_%'::text) OR (NOT (EXISTS ( SELECT 1
                   FROM pg_class
                  WHERE (((pg_class.relnamespace = t.typnamespace) AND (pg_class.relname = ("substring"((t.typname)::text, 2))::name)) AND (pg_class.relkind <> 'c'::"char"))))))) AND (nsp.nspname <> 'information_schema'::name))
        UNION
         SELECT 'bigserial'::text AS text,
            'bigserial'::text AS text,
            0,
            8,
            'b'::"char" AS "char",
            0,
            'pg_catalog'::name AS name,
            false AS bool
        UNION
         SELECT 'serial'::text AS text,
            'serial'::text AS text,
            0,
            4,
            'b'::"char" AS "char",
            0,
            'pg_catalog'::name AS name,
            false AS bool) dummy
  WHERE (dummy.typname !~~ '%[]%'::text)
  ORDER BY (dummy.nspname <> 'pg_catalog'::name), (dummy.nspname <> 'public'::name), dummy.nspname, dummy.oid;


