--
-- TOC entry 213 (class 1259 OID 507160)
-- Name: vw_баланс; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "vw_баланс" AS
 SELECT DISTINCT "счета"."КОД",
    "счета"."СЧЕТ",
    "счета"."ИМЯ",
    COALESCE("дбсальдо"."ДБКОНСАЛЬДО", (0)::numeric) AS "ДБКОНСАЛЬДО",
    COALESCE("крсальдо"."КРКОНСАЛЬДО", (0)::numeric) AS "КРКОНСАЛЬДО"
   FROM (("счета"
     LEFT JOIN ( SELECT DISTINCT "сальдо"."СЧЕТ",
            sum("сальдо"."КОНСАЛЬДО") AS "ДБКОНСАЛЬДО"
           FROM "сальдо"
          WHERE (("сальдо"."КОНСАЛЬДО" > (0)::numeric) AND (substr(("сальдо"."СЧЕТ")::text, 1, 2) <> '00'::text))
          GROUP BY "сальдо"."СЧЕТ"
          ORDER BY "сальдо"."СЧЕТ", sum("сальдо"."КОНСАЛЬДО")) "дбсальдо" ON (("счета"."СЧЕТ" = "дбсальдо"."СЧЕТ")))
     LEFT JOIN ( SELECT DISTINCT "сальдо"."СЧЕТ",
            (- sum("сальдо"."КОНСАЛЬДО")) AS "КРКОНСАЛЬДО"
           FROM "сальдо"
          WHERE (("сальдо"."КОНСАЛЬДО" < (0)::numeric) AND (substr(("сальдо"."СЧЕТ")::text, 1, 2) <> '00'::text))
          GROUP BY "сальдо"."СЧЕТ"
          ORDER BY "сальдо"."СЧЕТ", (- sum("сальдо"."КОНСАЛЬДО"))) "крсальдо" ON (("счета"."СЧЕТ" = "крсальдо"."СЧЕТ")))
  ORDER BY "счета"."КОД", "счета"."СЧЕТ", "счета"."ИМЯ", COALESCE("дбсальдо"."ДБКОНСАЛЬДО", (0)::numeric), COALESCE("крсальдо"."КРКОНСАЛЬДО", (0)::numeric);


