--
-- TOC entry 228 (class 1259 OID 507246)
-- Name: vw_закупоч_цены_на_товар; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "vw_закупоч_цены_на_товар" AS
 SELECT DISTINCT s."КОД",
    s."КОД_АДРЕС",
    s."КОД_ТОВАР",
    s."ИМЯ",
    s."КОД_ГРУППЫ",
    s."ЦЕНА",
    (round((s."ЗАКСУММА" / s."КОЛ"), 2))::numeric(10,2) AS "ЗАКЦЕНА",
    s."КОЛ",
    s."АВТОМАТ_ЦЕНА"
   FROM ( SELECT s_1."КОД",
            s_1."КОД_АДРЕС",
            s_1."КОД_ТОВАР",
            t."ИМЯ",
            t."КОД_ГРУППЫ",
            t."ЦЕНА",
            (s1."КОНСАЛЬДО" + s2."КОНСАЛЬДО") AS "ЗАКСУММА",
            s1."КОНКОЛ" AS "КОЛ",
            t."АВТОМАТ_ЦЕНА"
           FROM ((("набор1" s_1
             JOIN "сальдо" s1 ON (((s1."СЧЕТ" = '411'::bpchar) AND (s_1."КОД" = s1."КОД"))))
             JOIN "сальдо" s2 ON (((s2."СЧЕТ" = '421'::bpchar) AND (s_1."КОД" = s2."КОД"))))
             JOIN ( SELECT n."КОД",
                    n."ИМЯ",
                    n."КОД_ГРУППЫ",
                    (COALESCE(n."ЦЕНА", (0)::numeric))::numeric(10,2) AS "ЦЕНА",
                    n."АВТОМАТ_ЦЕНА"
                   FROM (("набор1" s_2
                     JOIN "товар" n ON ((n."КОД" = s_2."КОД_ТОВАР")))
                     JOIN "сальдо" c ON ((((s_2."КОД" = c."КОД") AND (c."СЧЕТ" = '411'::bpchar)) AND (c."КОНКОЛ" <> (0)::numeric))))) t ON ((s_1."КОД_ТОВАР" = t."КОД")))
          WHERE (s1."КОНКОЛ" <> (0)::numeric)) s
  ORDER BY s."КОД", s."КОД_АДРЕС", s."КОД_ТОВАР", s."ИМЯ", s."КОД_ГРУППЫ", s."ЦЕНА", (round((s."ЗАКСУММА" / s."КОЛ"), 2))::numeric(10,2), s."КОЛ", s."АВТОМАТ_ЦЕНА";


ALTER TABLE public."vw_закупоч_цены_на_товар" OWNER TO sa;

