--
-- TOC entry 230 (class 1259 OID 507255)
-- Name: vw_закупоч_и_розн_цены; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "vw_закупоч_и_розн_цены" AS
 SELECT z."КОД",
    z."КОД_АДРЕС",
    z."КОД_ТОВАР",
    z."КОД_ГРУППЫ",
    z."КОЛ",
    z."ЗАКЦЕНА",
    (round((z."КОЛ" * z."ЗАКЦЕНА"), 2))::numeric(10,2) AS "ЗАКСУММА",
    z."ЦЕНА",
    (round((z."КОЛ" * z."ЦЕНА"), 2))::numeric(10,2) AS "СУММА",
    (
        CASE
            WHEN (z."ЗАКЦЕНА" <> (0)::numeric) THEN round((((z."ЦЕНА" - z."ЗАКЦЕНА") * (100)::numeric) / z."ЗАКЦЕНА"), 2)
            ELSE NULL::numeric
        END)::numeric(10,2) AS "НАЦЕНКА"
   FROM (("vw_закупоч_цены_на_товар" z
     JOIN "адрес" a ON ((z."КОД_АДРЕС" = a."КОД")))
     JOIN "товар" t ON ((z."КОД_ТОВАР" = t."КОД")))
  ORDER BY t."ИМЯ", a."ИМЯ";


