-- Name: vw_наценки; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "vw_наценки" AS
 SELECT t."КОД",
    t."ИМЯ",
    t."ШИФР_ПО_КАТАЛОГУ",
    t."ЕДИЗМ",
    s."КОНКОЛ" AS "ОСТАТОК",
    s."ЗАК_ЦЕНА",
    t."ЦЕНА",
        CASE
            WHEN (s."ЗАК_ЦЕНА" <> (0)::numeric) THEN round((((t."ЦЕНА" - s."ЗАК_ЦЕНА") * (100)::numeric) / s."ЗАК_ЦЕНА"), 2)
            ELSE 999999999.99
        END AS "ПРОЦЕНТ"
   FROM ("товар" t
     JOIN ( SELECT n."КОД_ТОВАР" AS "КОД",
            s1."КОНКОЛ",
            round(((s1."КОНСАЛЬДО" + s2."КОНСАЛЬДО") / s1."КОНКОЛ"), 2) AS "ЗАК_ЦЕНА"
           FROM (("набор1" n
             JOIN "сальдо" s1 ON (((n."КОД" = s1."КОД") AND (s1."СЧЕТ" = '411'::bpchar))))
             JOIN "сальдо" s2 ON (((n."КОД" = s2."КОД") AND (s2."СЧЕТ" = '421'::bpchar))))
          WHERE (s1."КОНКОЛ" <> (0)::numeric)) s ON ((t."КОД" = s."КОД")))
  ORDER BY t."ИМЯ";


