            o."КОД_ФИРМЫ"
           FROM ("vw_накладные_по_браку" n_1
             JOIN "организации" o ON ((n_1."КОД_ОРГАНИЗАЦИИ" = o."КОД")))
          WHERE (n_1."ТИП" = 'Недовоз'::text)) n
     JOIN ( SELECT p_1."КОД",
            p_1."ИМЯ",
            p_1."КОД_ФИРМЫ",
            p_1."КОДВПРАЙСЕ",
            p_1."ШИФР_ПО_КАТАЛОГУ",
