            p_1."УПАКОВКА",
            p_1."СТРОГО",
            p_1."НАЛИЧИЕ",
            p_1.fts,
            p_1."КОД_ТОВАР",
            p_1."КОЛ_ПРАЙС",
            p_1."КОЛ_ТОВАР",
            p_1."ПРИОРИТЕТ",
            p_1."ПРОИЗВОДИТЕЛЬ"
           FROM ("прайс" p_1
             JOIN ( SELECT p_2."КОД_ФИРМЫ",
                    p_2."ИМЯ",
                    max(p_2."ДАТА") AS "ДАТА"
                   FROM "прайс" p_2
                  GROUP BY p_2."КОД_ФИРМЫ", p_2."ИМЯ") p1 ON ((((p_1."КОД_ФИРМЫ" = p1."КОД_ФИРМЫ") AND ((p_1."ИМЯ")::text = (p1."ИМЯ")::text)) AND (p_1."ДАТА" = p1."ДАТА"))))) p ON ((((p."КОД_ФИРМЫ" = n."КОД_ФИРМЫ") AND (p."КОД_ТОВАР" = n."КОД")) AND (p."ПРИОРИТЕТ" = 1))))
