                                    "наценки"."МАКСПОРОГСУММА"
                                   FROM "наценки") n ON ((((t_2."ЗАКЦЕНА" >= n."МИНПОРОГСУММА") AND (t_2."ЗАКЦЕНА" < n."МАКСПОРОГСУММА")) AND (t_2."КОД_ГРУППЫ" = n."КОД_ГРУППЫ"))))) t_1,
                    ( SELECT ("константы"."ЗНАЧЕНИЕ")::numeric(10,5) AS "ПРОЦЕНТ"
                           FROM "константы"
