--
-- TOC entry 250 (class 1259 OID 507390)
-- Name: vw_новыецены_на_остатки; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "vw_новыецены_на_остатки" AS
 SELECT s."КОД",
    s."КОД_ТОВАР",
    s."КОД_АДРЕС",
    s."КОД_ГРУППЫ",
    s."КОЛ",
    s."ЗАКЦЕНА",
    s."ЦЕНА",
    s."НАЦЕНКА",
    s."НОВЦЕНА",
    s."НОВНАЦЕНКА"
   FROM ( SELECT d."КОД",
            d."КОД_ТОВАР",
            d."КОД_АДРЕС",
            d."КОД_ГРУППЫ",
            (d."ЗАКЦЕНА")::numeric(10,2) AS "ЗАКЦЕНА",
            d."ЦЕНА",
            ((d."НАЦЕНКА" * (100)::numeric))::numeric(5,2) AS "НАЦЕНКА",
            (
                CASE
                    WHEN (d."ОКРУГЛЕНИЕ" = (1)::numeric) THEN (round((d."НОВЦЕНА" * (2)::numeric), 0) / (2)::numeric)
                    WHEN (d."ОКРУГЛЕНИЕ" = (2)::numeric) THEN round(d."НОВЦЕНА", 0)
                    WHEN (d."ОКРУГЛЕНИЕ" = (3)::numeric) THEN round(d."НОВЦЕНА", (-1))
                    WHEN (d."ОКРУГЛЕНИЕ" = (4)::numeric) THEN round(d."НОВЦЕНА", (-2))
                    ELSE d."НОВЦЕНА"
                END)::numeric(10,2) AS "НОВЦЕНА",
            ((d."НОВНАЦЕНКА" * (100)::numeric))::numeric(5,2) AS "НОВНАЦЕНКА",
            (d."КОЛ")::numeric(8,3) AS "КОЛ"
           FROM ( SELECT t."КОД",
                    t."КОД_ТОВАР",
                    t."КОД_АДРЕС",
                    t."КОД_ГРУППЫ",
                    t."ЗАКЦЕНА",
                    t."ЦЕНА",
                    t."НАЦЕНКА",
                    t."МИНПРОЦЕНТ",
                        CASE
                            WHEN (((t."НАЦЕНКА" < t."МИНПРОЦЕНТ") OR (t."НАЦЕНКА" > t."МАКСПРОЦЕНТ")) AND ((t."ЗАКЦЕНА" * (t."НОВНАЦЕНКА" + (1)::numeric)) < (t."ЦЕНА" * ((1)::numeric - (s_1."ПРОЦЕНТ" / (100)::numeric))))) THEN ((t."ЦЕНА" * ((1)::numeric - (s_1."ПРОЦЕНТ" / (100)::numeric))))::numeric(10,2)
                            ELSE ((t."ЗАКЦЕНА" * (t."НОВНАЦЕНКА" + (1)::numeric)))::numeric(10,2)
                        END AS "НОВЦЕНА",
                    t."НОВНАЦЕНКА",
                    t."КОЛ",
                    t."ОКРУГЛЕНИЕ"
                   FROM ( SELECT t_1."КОД",
                            t_1."КОД_ТОВАР",
                            t_1."КОД_АДРЕС",
                            t_1."КОД_ГРУППЫ",
                            t_1."ЗАКЦЕНА",
                            t_1."ЦЕНА",
                            t_1."НАЦЕНКА",
                            t_1."КОЛ",
                            n."МИНПРОЦЕНТ",
                            n."МАКСПРОЦЕНТ",
                            n."НАЦЕНКА" AS "НОВНАЦЕНКА",
                            n."ОКРУГЛЕНИЕ"
                           FROM (( SELECT t_2."КОД",
                                    s_2."КОД_ТОВАР",
                                    t_2."КОД_АДРЕС",
                                    t_2."КОД_ГРУППЫ",
                                    s_2."ЗАКЦЕНА",
                                    t_2."ЦЕНА",
                                    ((t_2."ЦЕНА" - s_2."ЗАКЦЕНА") / s_2."ЗАКЦЕНА") AS "НАЦЕНКА",
                                    t_2."КОЛ"
                                   FROM (( SELECT s_3."КОД_ТОВАР",
    min(s_3."ЦЕНА") AS "ЗАКЦЕНА"
   FROM ( SELECT p."КОД_ТОВАР",
      p."КОД_ФИРМЫ",
      (((p."МИНЦЕНА" * p."КОЛ_ПРАЙС") / p."КОЛ_ТОВАР"))::numeric(10,2) AS "ЦЕНА"
     FROM ("прайс" p
       JOIN "vw_блокпериоды" v ON ((p."ДАТА" >= v."НАЧАЛО")))
    WHERE ((p."ПРИОРИТЕТ" = 1) AND (p."КОД_ТОВАР" <> 0))) s_3
  WHERE (s_3."ЦЕНА" <> (0)::numeric)
  GROUP BY s_3."КОД_ТОВАР") s_2
                                     JOIN ( SELECT s_3."КОД",
    s_3."КОД_ТОВАР",
    s_3."КОД_АДРЕС",
    t_3."КОД_ГРУППЫ",
    t_3."ЦЕНА",
    s_3."КОЛ"
   FROM ("товар" t_3
     JOIN ( SELECT vw_saldo411."КОД",
      vw_saldo411."КОД_ТОВАР",
      vw_saldo411."КОД_АДРЕС",
      sum(vw_saldo411."КОНКОЛ") AS "КОЛ"
     FROM vw_saldo411
    WHERE (vw_saldo411."КОНКОЛ" > (0)::numeric)
    GROUP BY vw_saldo411."КОД", vw_saldo411."КОД_ТОВАР", vw_saldo411."КОД_АДРЕС") s_3 ON (((t_3."КОД" = s_3."КОД_ТОВАР") AND (t_3."АВТОМАТ_ЦЕНА" = true))))) t_2 ON ((s_2."КОД_ТОВАР" = t_2."КОД_ТОВАР")))) t_1
                             JOIN ( SELECT "наценки"."КОД_ГРУППЫ",
                                    ("наценки"."МИНПРОЦЕНТ" / (100)::numeric) AS "МИНПРОЦЕНТ",
                                    ("наценки"."МАКСПРОЦЕНТ" / (100)::numeric) AS "МАКСПРОЦЕНТ",
                                    ("наценки"."НАЦЕНКА" / (100)::numeric) AS "НАЦЕНКА",
                                    "наценки"."ОКРУГЛЕНИЕ",
                                    "наценки"."МИНПОРОГСУММА",
                                    "наценки"."МАКСПОРОГСУММА"
                                   FROM "наценки") n ON ((((t_1."ЦЕНА" >= n."МИНПОРОГСУММА") AND (t_1."ЦЕНА" < n."МАКСПОРОГСУММА")) AND (t_1."КОД_ГРУППЫ" = n."КОД_ГРУППЫ"))))) t,
                    ( SELECT ("константы"."ЗНАЧЕНИЕ")::numeric(10,5) AS "ПРОЦЕНТ"
                           FROM "константы"
                          WHERE (rtrim(("константы"."ИМЯ")::text) = 'ПроцентСнижения'::text)) s_1
                  WHERE (t."НАЦЕНКА" < t."МИНПРОЦЕНТ")) d) s;


