    "товар"."КОЛ_НА_АВТОМОБИЛЕ",
    COALESCE(s."ОСТАТОК", (0)::numeric) AS "ОСТАТОК"
   FROM ("товар"
     LEFT JOIN ( SELECT vw_saldo411."КОД_ТОВАР",
