    t."ЕДИЗМ",
    t."КОЛ",
    t."СУММАЗАК",
    t."СУММАПРОД"
   FROM (( SELECT t_1."КОД",
            t_1."ИМЯ",
            t_1."ШИФР_ПО_КАТАЛОГУ" AS "АРТИКУЛ",
            t_1."ЕДИЗМ",
            t_1."КОД_ГРУППЫ",
            s."КОЛ",
            s."СУММАЗАК",
            s."СУММАПРОД"
           FROM (( SELECT s_1."КОД_ТОВАР" AS "КОД",
                    sum(t_2."КОЛ") AS "КОЛ",
