                    sum(t_2."СУММАПРОД") AS "СУММАПРОД"
                   FROM (( SELECT sp."КОД",
                            sp."КОЛ",
                            (sp."КОНСАЛЬДО" + sn."КОНСАЛЬДО") AS "СУММАЗАК",
                            sp."КОНСАЛЬДО" AS "СУММАПРОД"
                           FROM (sp_calcoborot('411'::character varying, (( SELECT to_char(("vw_блокпериоды"."КОНЕЦ")::timestamp with time zone, 'DD.MM.YYYY'::text) AS "ДАТА"
                                   FROM "vw_блокпериоды"))::character varying, (( SELECT to_char(("vw_блокпериоды"."КОНЕЦ")::timestamp with time zone, 'DD.MM.YYYY'::text) AS "ДАТА"
                                   FROM "vw_блокпериоды"))::character varying) sp("КОД", "КОЛ", "САЛЬДО", "ДБКОЛ", "ДЕБЕТ", "КРКОЛ", "КРЕДИТ", "КОНКОЛ", "КОНСАЛЬДО", "cКОЛ", "cСАЛЬДО", "cДБКОЛ", "cДЕБЕТ", "cКРКОЛ", "cКРЕДИТ", "cКОНКОЛ", "cКОНСАЛЬДО")
                             JOIN sp_calcoborot('421'::character varying, (( SELECT to_char(("vw_блокпериоды"."КОНЕЦ")::timestamp with time zone, 'DD.MM.YYYY'::text) AS "ДАТА"
                                   FROM "vw_блокпериоды"))::character varying, (( SELECT to_char(("vw_блокпериоды"."КОНЕЦ")::timestamp with time zone, 'DD.MM.YYYY'::text) AS "ДАТА"
                                   FROM "vw_блокпериоды"))::character varying) sn("КОД", "КОЛ", "САЛЬДО", "ДБКОЛ", "ДЕБЕТ", "КРКОЛ", "КРЕДИТ", "КОНКОЛ", "КОНСАЛЬДО", "cКОЛ", "cСАЛЬДО", "cДБКОЛ", "cДЕБЕТ", "cКРКОЛ", "cКРЕДИТ", "cКОНКОЛ", "cКОНСАЛЬДО") ON ((sp."КОД" = sn."КОД")))
                          WHERE (sp."КОНКОЛ" <> (0)::numeric)) t_2
                     JOIN "набор1" s_1 ON ((t_2."КОД" = s_1."КОД")))
                  GROUP BY s_1."КОД_ТОВАР") s
             JOIN "товар" t_1 ON ((t_1."КОД" = s."КОД")))) t
     JOIN "группы" g ON ((t."КОД_ГРУППЫ" = g."КОД")))
  ORDER BY g."ИМЯ", t."ИМЯ";


