--
-- TOC entry 254 (class 1259 OID 507410)
-- Name: vw_отчет_о_продажах; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "vw_отчет_о_продажах" AS
 SELECT s."ДАТА",
    t."КОД",
    t."ИМЯ",
    t."ШИФР_ПО_КАТАЛОГУ",
    t."ЕДИЗМ",
    t."КОД_ГРУППЫ",
    sum(s."КОЛ") AS "КОЛ",
    sum(s."СУММА") AS sum
   FROM ("товар" t
     JOIN ( SELECT s_1."КОД_ТОВАР",
            p."ДАТА",
            p."КОЛ",
            p."ЦЕНА",
            p."СУММА"
           FROM (( SELECT d."ДАТА",
                    p_1."КРКОД",
                    p_1."КОЛ",
                    p_1."ЦЕНА",
                    p_1."СУММА"
                   FROM ("проводки" p_1
                     JOIN ( SELECT "документы"."КОД",
                            "документы"."ДАТА"
                           FROM "документы"
                          WHERE ((("документы"."ДАТА" <= ('now'::text)::date) AND ("документы"."ДАТА" >= (('now'::text)::date - 720))) AND (("документы"."ОПЕР" = 1) OR ("документы"."ОПЕР" = 11)))) d ON ((p_1."ДОККОД" = d."КОД")))
                  WHERE (p_1."КОЛ" > (0)::numeric)) p
             JOIN "набор1" s_1 ON ((p."КРКОД" = s_1."КОД")))) s ON ((t."КОД" = s."КОД_ТОВАР")))
  GROUP BY s."ДАТА", t."ИМЯ", t."КОД", t."ШИФР_ПО_КАТАЛОГУ", t."ЕДИЗМ", t."КОД_ГРУППЫ"
