 SELECT s."ДАТА",
    t."ИМЯ",
    t."ШИФР_ПО_КАТАЛОГУ",
    t."ЕДИЗМ",
    t."КОД_ГРУППЫ",
    sum(s."КОЛ") AS "КОЛ",
    sum(s."СУММА") AS "СУММА"
   FROM ("товар" t
     JOIN ( SELECT s_1."КОД_ТОВАР",
            p."ДАТА",
            p."КОЛ",
            p."ЦЕНА",
            p."СУММА"
           FROM (( SELECT d."ДАТА",
                    p_1."КРКОД",
                    p_1."КОЛ",
                    p_1."ЦЕНА",
                    p_1."СУММА"
                   FROM ("проводки" p_1
                     JOIN ( SELECT "документы"."КОД",
                            "документы"."ДАТА"
                           FROM "документы",
                            ( SELECT "блокпериоды"."НАЧАЛО",
                                    "блокпериоды"."КОНЕЦ"
                                   FROM "блокпериоды"
                                  WHERE (("блокпериоды"."ПОЛЬЗОВАТЕЛЬ")::text = 'sa'::text)) bp
                          WHERE ((("документы"."ДАТА" <= bp."КОНЕЦ") AND ("документы"."ДАТА" >= bp."НАЧАЛО")) AND (("документы"."ОПЕР" = 1) OR ("документы"."ОПЕР" = 11)))) d ON ((p_1."ДОККОД" = d."КОД")))
                  WHERE (p_1."КОЛ" > (0)::numeric)) p
             JOIN "набор1" s_1 ON ((p."КРКОД" = s_1."КОД")))) s ON ((t."КОД" = s."КОД_ТОВАР")))
  GROUP BY s."ДАТА", t."ИМЯ", t."ШИФР_ПО_КАТАЛОГУ", t."ЕДИЗМ", t."КОД_ГРУППЫ"
  ORDER BY s."ДАТА", t."ИМЯ";


