--
-- TOC entry 257 (class 1259 OID 507423)
-- Name: vw_перемещение; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "vw_перемещение" AS
 SELECT f."КОД" AS "КРКОД",
    t."КОД" AS "ДБКОД"
   FROM (( SELECT n."КОД",
            n."КОД_ТОВАР"
           FROM (("набор1" n
             JOIN "адрес" a ON ((n."КОД_АДРЕС" = a."КОД")))
             JOIN "сальдо" s ON (((s."СЧЕТ" = '411'::bpchar) AND (n."КОД" = s."КОД"))))
          WHERE (("substring"((a."ИМЯ")::text, 1, 1) = '2'::text) AND (s."КОНКОЛ" > (0)::numeric))) f
     JOIN ( SELECT n."КОД",
            n."КОД_ТОВАР",
            n."ИМЯ"
           FROM (( SELECT n_1."КОД",
                    a."КОД_ТОВАР",
                    a."ИМЯ"
                   FROM ("набор1" n_1
                     JOIN ( SELECT DISTINCT a_1."КОД",
                            p."КОД_ТОВАР",
                            a_1."ИМЯ"
                           FROM ("посладрес" p
                             JOIN "адрес" a_1 ON ((a_1."КОД" = p."КОД_АДРЕС")))
                          ORDER BY a_1."КОД", p."КОД_ТОВАР", a_1."ИМЯ") a ON (((n_1."КОД_АДРЕС" = a."КОД") AND (n_1."КОД_ТОВАР" = a."КОД_ТОВАР"))))) n
             LEFT JOIN "сальдо" s ON (((s."СЧЕТ" = '411'::bpchar) AND (n."КОД" = s."КОД"))))
          WHERE (("substring"((n."ИМЯ")::text, 1, 1) = '1'::text) AND (s."КОНКОЛ" <= (0)::numeric))) t ON ((f."КОД_ТОВАР" = t."КОД_ТОВАР")));


