--
-- TOC entry 259 (class 1259 OID 507441)
-- Name: vw_прайс; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "vw_прайс" AS
 SELECT DISTINCT s."КОД",
    s."КОДВПРАЙСЕ",
    s."ИМЯ",
    s."КОД_ФИРМЫ",
    s."ШИФР_ПО_КАТАЛОГУ",
    s."ЕДИЗМ",
    s."ДАТА",
    (s."МИНЦЕНА")::numeric(10,2) AS "МИНЦЕНА",
    s."УПАКОВКА",
    s."СТРОГО",
    s."НАЛИЧИЕ",
    s."ПРОИЗВОДИТЕЛЬ",
    s.fts,
    s."PHOTO_URL"
   FROM ( SELECT s_1."КОД",
            s_1."КОДВПРАЙСЕ",
            s_1."ИМЯ",
            s_1."ШИФР_ПО_КАТАЛОГУ",
            s_1."ЕДИЗМ",
            s_1."ДАТА",
            s_1."КОД_ФИРМЫ",
                CASE
                    WHEN ((f."РОЗНИЦА" = false) AND (s_1."МИНЦЕНА" < (1)::numeric)) THEN round((s_1."МИНЦЕНА" * 1.5), 1)
                    WHEN ((f."РОЗНИЦА" = false) AND (s_1."МИНЦЕНА" < (5)::numeric)) THEN round((s_1."МИНЦЕНА" * 1.4), 1)
                    WHEN ((f."РОЗНИЦА" = false) AND (s_1."МИНЦЕНА" < (10)::numeric)) THEN round((s_1."МИНЦЕНА" * 1.3), 1)
                    WHEN ((f."РОЗНИЦА" = false) AND (s_1."МИНЦЕНА" < (100)::numeric)) THEN round((s_1."МИНЦЕНА" * 1.2), 0)
                    WHEN ((f."РОЗНИЦА" = false) AND (s_1."МИНЦЕНА" < (500)::numeric)) THEN round((s_1."МИНЦЕНА" * 1.15), (-1))
                    WHEN ((f."РОЗНИЦА" = false) AND (s_1."МИНЦЕНА" < (1000)::numeric)) THEN round((s_1."МИНЦЕНА" * 1.10), (-1))
                    WHEN ((f."РОЗНИЦА" = false) AND (s_1."МИНЦЕНА" < (1000000)::numeric)) THEN round((s_1."МИНЦЕНА" * 1.10), (-2))
                    ELSE s_1."МИНЦЕНА"
                END AS "МИНЦЕНА",
            s_1."УПАКОВКА",
            s_1."СТРОГО",
            s_1."НАЛИЧИЕ",
            s_1."ПРОИЗВОДИТЕЛЬ",
            s_1.fts,
            s_1."PHOTO_URL"
           FROM (("прайс" s_1
             JOIN "vw_блокпериоды" b ON (((s_1."ДАТА" > (b."НАЧАЛО" - 1)) AND (s_1."ДАТА" < (b."КОНЕЦ" + 1)))))
             JOIN "фирмы" f ON ((s_1."КОД_ФИРМЫ" = f."КОД")))) s
  WHERE (s."МИНЦЕНА" <> (0)::numeric)
  ORDER BY s."КОД", s."КОДВПРАЙСЕ", s."ИМЯ", s."КОД_ФИРМЫ", s."ШИФР_ПО_КАТАЛОГУ", s."ЕДИЗМ", s."ДАТА", (s."МИНЦЕНА")::numeric(10,2), s."УПАКОВКА", s."СТРОГО", s."НАЛИЧИЕ";


