 SELECT "набор1"."КОД",
    "набор1"."КОД_ТОВАР",
    "адрес"."ИМЯ" AS "АДРЕС_ИМЯ",
    "товар"."ИМЯ",
    (("товар"."ЦЕНА" * "сальдо"."КОНКОЛ") - "сальдо"."КОНСАЛЬДО") AS "РАЗНИЦА",
    "сальдо"."КОНКОЛ",
    "товар"."ЦЕНА",
    "сальдо"."КОНСАЛЬДО"
   FROM ((("сальдо"
     JOIN "набор1" ON (("сальдо"."КОД" = "набор1"."КОД")))
     JOIN "товар" ON (("набор1"."КОД_ТОВАР" = "товар"."КОД")))
     JOIN "адрес" ON (("набор1"."КОД_АДРЕС" = "адрес"."КОД")))
  WHERE (((("товар"."ЦЕНА" * "сальдо"."КОНКОЛ") - "сальдо"."КОНСАЛЬДО") <> (0)::numeric) AND ("сальдо"."СЧЕТ" = '411'::bpchar));


