-- Name: vw_справочники_со_столбцами; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "vw_справочники_со_столбцами" AS
 SELECT s."КОД",
    s."ИМЯ"
   FROM "справочники" s
UNION
 SELECT (1000000 + "топер"."ОПЕР") AS "КОД",
    ('СписокДокументов'::text || btrim((("топер"."ОПЕР")::character varying(20))::text)) AS "ИМЯ"
   FROM "топер"
  WHERE ("топер"."НОМЕР" = 1)
UNION
 SELECT (2000000 + "топер"."ОПЕР") AS "КОД",
    ('Документ'::text || btrim((("топер"."ОПЕР")::character varying(20))::text)) AS "ИМЯ"
   FROM "топер"
  WHERE ("топер"."НОМЕР" = 1)
UNION
 SELECT (3000000 + s."КОД") AS "КОД",
    ('saldo'::text || (s."СЧЕТ")::text) AS "ИМЯ"
   FROM "счета" s
UNION
 SELECT s."КОД",
    ('документы'::text || (s."КОД" - 4000000)) AS "ИМЯ"
   FROM ( SELECT "столбцы"."КОДТАБЛИЦЫ" AS "КОД"
           FROM "столбцы"
          WHERE (("столбцы"."КОДТАБЛИЦЫ" > 4000000) AND ("столбцы"."КОДТАБЛИЦЫ" <= 4999999))
          GROUP BY "столбцы"."КОДТАБЛИЦЫ") s;


