--
-- TOC entry 268 (class 1259 OID 507483)
-- Name: vw_столбцы; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "vw_столбцы" AS
 SELECT s."БАЗСПРАВОЧНИК",
    s."СПРАВОЧНИК",
    s."СТОЛБЕЦ",
    s."ЗАГОЛОВОК",
    s."НОМЕР",
    s."ТОЛЬКОЧТЕНИЕ"
   FROM ( SELECT DISTINCT btrim((d."ИМЯ")::text) AS "БАЗСПРАВОЧНИК",
                CASE
                    WHEN ((d."КОД" >= 1000000) AND ("substring"(btrim(to_char(d."КОД", '9999999'::text)), 1, 1) = '1'::text)) THEN 'документы'::character varying
                    WHEN ((d."КОД" >= 2000000) AND ("substring"(btrim(to_char(d."КОД", '9999999'::text)), 1, 1) = '2'::text)) THEN 'проводки'::character varying
                    WHEN ((d."КОД" >= 3000000) AND ("substring"(btrim(to_char(d."КОД", '9999999'::text)), 1, 1) = '3'::text)) THEN d1."ИМЯ"
                    ELSE d1."ИМЯ"
                END AS "СПРАВОЧНИК",
                CASE
                    WHEN ("position"((s_1."ИМЯ")::text, '.'::text) > 0) THEN ("substring"((s_1."ИМЯ")::text, ("position"((s_1."ИМЯ")::text, '.'::text) + 1)))::character varying
                    ELSE s_1."ИМЯ"
                END AS "СТОЛБЕЦ",
            s_1."ЗАГОЛОВОК",
            s_1."НОМЕР",
            s_1."ТОЛЬКОЧТЕНИЕ"
           FROM (("столбцы" s_1
             JOIN "vw_справочники_со_столбцами" d ON ((s_1."КОД_VW_СПРАВОЧНИКИ_СО_СТОЛБЦАМИ" = d."КОД")))
             JOIN "vw_справочники_со_столбцами" d1 ON ((s_1."КОДТАБЛИЦЫ" = d1."КОД")))) s
  WHERE ((s."СТОЛБЕЦ")::text <> ''::text)
  ORDER BY s."СПРАВОЧНИК", s."НОМЕР";


ALTER TABLE public."vw_столбцы" OWNER TO sa;

--
-- TOC entry 269 (class 1259 OID 507488)
-- Name: vw_столбцы_типы; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "vw_столбцы_типы" AS
 SELECT DISTINCT s."БАЗСПРАВОЧНИК" AS base_table,
    ins.table_name,
    ins."column",
    ins.name,
    ins.type,
    ins.length,
    ins."precision",
    ins.is_updatable,
    COALESCE(s."ЗАГОЛОВОК", ''::character varying) AS header,
    COALESCE(s."НОМЕР", (0)::numeric) AS number
   FROM (( SELECT "vw_столбцы"."БАЗСПРАВОЧНИК",
            "vw_столбцы"."СПРАВОЧНИК",
            "vw_столбцы"."СТОЛБЕЦ",
            "vw_столбцы"."ЗАГОЛОВОК",
            "vw_столбцы"."НОМЕР"
           FROM "vw_столбцы") s
     RIGHT JOIN ( SELECT DISTINCT ins_1.table_name,
            ((ins_1.ordinal_position)::integer - 1) AS "column",
            ins_1.column_name AS name,
            ins_1.data_type AS type,
            (COALESCE((ins_1.character_maximum_length)::integer, 0) + COALESCE((ins_1.numeric_precision)::integer, 0)) AS length,
            COALESCE((ins_1.numeric_scale)::integer, 0) AS "precision",
            ins_1.is_updatable
           FROM (information_schema.columns ins_1
             JOIN "vw_столбцы" s_1 ON ((((ins_1.table_name)::text = (s_1."СПРАВОЧНИК")::text) AND (btrim(s_1."БАЗСПРАВОЧНИК") = 'заявка'::text))))) ins ON ((((s."СПРАВОЧНИК")::text = (ins.table_name)::text) AND ((s."СТОЛБЕЦ")::text = (ins.name)::text))))
  ORDER BY ins.table_name, ins."column";


ALTER TABLE public."vw_столбцы_типы" OWNER TO sa;

