-- TOC entry 271 (class 1259 OID 507497)
-- Name: vw_товар_без_продаж_за_год; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "vw_товар_без_продаж_за_год" AS
 SELECT t."КОД_ТОВАР" AS "КОД",
    t."ИМЯ",
    t."ШИФР_ПО_КАТАЛОГУ",
    t."ЕДИЗМ",
    t."КОД_ГРУППЫ",
    t."ЗАПАС",
    s."КОНКОЛ",
    t."ЦЕНА",
    ((s."КОНКОЛ" * t."ЦЕНА"))::numeric(12,2) AS "СУММА"
   FROM (( SELECT s_1."КОД",
            s_1."КОД_ТОВАР",
            t_1."ИМЯ",
            t_1."ШИФР_ПО_КАТАЛОГУ",
            t_1."ЕДИЗМ",
            t_1."КОД_ГРУППЫ",
            t_1."ЦЕНА",
            t_1."ЗАПАС"
           FROM ("товар" t_1
             JOIN "набор1" s_1 ON ((t_1."КОД" = s_1."КОД_ТОВАР")))) t
     JOIN vw_saldo411 s ON ((t."КОД" = s."КОД")))
  WHERE (NOT (t."КОД_ТОВАР" IN ( SELECT DISTINCT s_1."КОД_ТОВАР"
           FROM (( SELECT p_1."КРКОД"
                   FROM ("проводки" p_1
                     JOIN ( SELECT d_1."КОД"
                           FROM "документы" d_1
                          WHERE (((d_1."ДАТА" >= ((now())::date - 365)) AND (d_1."ДАТА" <= now())) AND (d_1."ОПЕР" = ANY (ARRAY[1, 11])))) d ON ((p_1."ДОККОД" = d."КОД")))
                  WHERE (p_1."НОМЕРОПЕР" = (1)::numeric)) p
             JOIN "набор1" s_1 ON ((p."КРКОД" = s_1."КОД")))
          ORDER BY s_1."КОД_ТОВАР")))
  ORDER BY t."КОД_ГРУППЫ", t."ИМЯ";


ALTER TABLE public."vw_товар_без_продаж_за_год" OWNER TO sa;

--
-- TOC entry 272 (class 1259 OID 507502)
-- Name: vw_топер; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "vw_топер" AS
 SELECT "топер"."КОД",
    "топер"."ОПЕР",
    "топер"."НОМЕР",
    "топер"."ИМЯ",
    "счета"."СЧЕТ" AS "ДБСЧЕТ",
    "счета"."ИМЯСПРАВОЧНИКА" AS "ДБСПРАВ",
    '                                        '::bpchar AS "ДБСПРАВАЛИАС",
    "счета"."КОЛИЧЕСТВО" AS "ДБКОЛ",
    "топер"."ДБПОСТ",
    "топер"."ДБСАЛВИДИМ",
    "топер"."ДБВИДИМ",
    "счета1"."СЧЕТ" AS "КРСЧЕТ",
    "счета1"."ИМЯСПРАВОЧНИКА" AS "КРСПРАВ",
    '                                        '::bpchar AS "КРСПРАВАЛИАС",
    "счета1"."КОЛИЧЕСТВО" AS "КРКОЛ",
    "топер"."ОДНАОПЕРАЦИЯ",
    "топер"."ИТОГИ",
    "топер"."КРПОСТ",
    "топер"."КРСАЛВИДИМ",
    "топер"."КРВИДИМ",
    "топер"."НЕЗАВИСИМ",
    "топер"."ПЕРЕМЕННЫЕ",
    "топер"."АТРИБУТЫ",
    "топер"."ДОКАТРИБУТЫ"
   FROM (("топер"
     LEFT JOIN "счета" "счета" ON ((("топер"."ДБСЧЕТ")::bpchar = "счета"."СЧЕТ")))
     LEFT JOIN "счета" "счета1" ON ((("топер"."КРСЧЕТ")::bpchar = "счета1"."СЧЕТ")));


ALTER TABLE public."vw_топер" OWNER TO sa;

