   FROM ("счета"
     JOIN "vw_доступ" ON ((rtrim(("счета"."СЧЕТ")::text) = rtrim("vw_доступ"."ИМЯ"))))
  WHERE ("vw_доступ"."КОД_ТИПЫОБЪЕКТОВ" = 2)
  ORDER BY "счета"."ИМЯ", "счета"."СЧЕТ";


