--
-- TOC entry 304 (class 1259 OID 507597)
-- Name: доступ_к_топер; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "доступ_к_топер" AS
 SELECT DISTINCT "топер"."КОД",
    "топер"."ИМЯ",
    s."МЕНЮ",
    "топер"."ОПЕР",
    "топер"."ФОРМА",
    "топер"."НЕЗАВИСИМ",
    s.selectable,
    s.insertable,
    s.deleteable,
    s.updateable
   FROM ("топер"
     JOIN ( SELECT "vw_доступ"."ИМЯ",
            "vw_доступ"."КОД_ТИПЫОБЪЕКТОВ",
            "vw_доступ"."МЕНЮ",
            true AS selectable,
            true AS insertable,
            true AS deleteable,
            true AS updateable
           FROM "vw_доступ"
          WHERE ("vw_доступ"."КОД_ТИПЫОБЪЕКТОВ" = 3)) s ON ((rtrim(("топер"."ОПЕР")::text) = rtrim(s."ИМЯ"))))
  WHERE (("топер"."НОМЕР" = 1) AND (s."МЕНЮ" = true))
  ORDER BY "топер"."ИМЯ", s."МЕНЮ", "топер"."ОПЕР", "топер"."ФОРМА", "топер"."НЕЗАВИСИМ";


