--
-- TOC entry 335 (class 1259 OID 507691)
-- Name: пр_пользователи; Type: VIEW; Schema: public; Owner: sa
--

CREATE VIEW "пр_пользователи" AS
 SELECT s."КОД",
    s."ИМЯ",
    s."ИМЯ_ПОЛЬЗОВАТЕЛЯ"
   FROM ( SELECT
                CASE
                    WHEN (p."КОД" IS NULL) THEN (u."КОД")::oid
                    ELSE (p."КОД")::oid
                END AS "КОД",
            u."ИМЯ",
            p."ИМЯ" AS "ИМЯ_ПОЛЬЗОВАТЕЛЯ"
           FROM (sp_get_users() u("КОД", "ИМЯ")
             JOIN "персонал" p ON (((u."КОД")::oid = (p."КОД_ПР_ПОЛЬЗОВАТЕЛИ")::oid)))
          WHERE ((u."ИМЯ")::name <> 'test'::name)
        UNION
         SELECT u."КОД",
            u."ИМЯ",
            ''::character varying(50) AS "ИМЯ_ПОЛЬЗОВАТЕЛЯ"
           FROM sp_get_users() u("КОД", "ИМЯ")
          WHERE ((u."ИМЯ")::name = 'sa'::name)) s
  ORDER BY s."ИМЯ", s."ИМЯ_ПОЛЬЗОВАТЕЛЯ";


ALTER TABLE public."пр_пользователи" OWNER TO sa;

